raziv. Měkká tkanina z mikrovláken nezanechává žmolky, jemně čistí, suší a leští. Díky malým rozměrům a přiložené taštičce je sada ideální na cestování.    &lt;strong&gt;Bezpečný, bez alkoholu&lt;/strong&gt;  Pro dosažení nejlepších výsledků nastříkejte sprej přímo na tkaninu z mikrovláken, lehce setřete a rychle vysušte přebytečnou tekutinu z povrchu LCD. Bezpečný pro časté použití na povrchy LCD, kdy pomáhá obnovit a udržet jas a čistotu.    &lt;strong&gt;MANHATTAN nedoporučuje čisticí roztok aplikovat přímo na jakýkoli povrch LCD. Nedoporučuje se také pro použití na antireflexní a polarizované materiály, či filtry.&lt;/strong&gt;    - Neobsahuje isopropyl-alkohol  - Bezpečný pro použití na povrchy LCD - pomáhá obnovit a udržet jas a čistotu  - Ideální na ploché obrazovky, notebooky, kapesní zařízení, klávesnice a další  - Měkký kartáček jemně odstraňuje přebytečný prach a nečistoty bez poškrábání  - Bezaerosolový čistič odstraňuje otisky prstů a šmouhy, aniž by obsahoval agresivní rozpouštědla  - Měkká tkanina z mikrovláken nezanechává žmolky, čistí, suší, leští a zanechává povrch beze šmouh    &lt;strong&gt;Specifikace:&lt;/strong&gt;  - Čistící roztok: 60 ml (2 oz.); teplota použití a skladování: -10 ~ 50° C  - Utěrka z mikrovláken: 20 x 19 cm (8 x 7.5 in.)   - Zasunovací kartáček: 14 cm (5.5 in.)  - Cestovní taštička    &lt;a href='http://www.manhattan-products.com/en-US/products/6741' target='_blank' title='Produktový list'&gt;&lt;strong&gt;Produktový list&lt;/strong&gt;&lt;/a&gt;","false","0","0001022300030002","8384","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","73.00","KS","0.00","2","2010-10-13T10:27:12.967","MAN","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328382_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328382_0b_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11104'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.118','length':'23.9','width':'15','height':'3.5'},'1':{'typ':'PACK','count':'