:{'typ':'PACK','count':'30','weight':'17.375','length':'40','width':'20.5','height':'28'}}","N","","false",""),("328548","254014","MANHATTAN Nástěnný držák LCD / TV, kloubový (max. 22'/12kg)","283.00","283.00","MAN","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","MANHATTAN","285.00","344.00","21.00","432351","true","3,00","","Manhattan","42021910","766623432351","MANHATTAN Nástěnný držák LCD / TV, kloubový (max. 22'/12kg)","Typ příslušenství:Držáky a stojany","1","Držák LCD MANHATTAN slouží k pohyblivému upevnění LCD panelu na stěnu. Odolná kovová konstrukce a dvoudílný držák poskytují rychlé, snadné a bezpečné upevnění k většině vertikálních ploch. Držák je VESA kompatibilní a díky dodávanému příslušenství je ihned připravený k instalaci.    - Bezpečně udrží jeden LCD monitor na zdi  - Možnost nastavení a zafixování sklonu a natočení  - Dvoudílný držák s robustní ocelovou konstrukcí se snadno připevní k většině svislých ploch  - Nízkoprofilové provedení je ideální pro domácí, kancelářské a komerční aplikace  - Splňuje standardy VESA 75 x 75 mm / 100 x 100 mm, pro monitory do 22'   - Nostnost max. 12 kg (26 lbs.)   - Rozměry konzole:  8 x 6.5 cm (3.15 x 2.5 in.); délka ramena: 12.5 cm (5 in.); hmotnost: 0.7 kg (1.5 lbs.)    &lt;a href='http://www.manhattan-products.com/downloads/5174-432351_QSG.pdf' target='_blank' title='Rychlý návod k použití (EN)'&gt;Rychlý návod k použití (EN)&lt;/a&gt;","false","0","000102230012","8475","2","true","","-1","-1","true","24","Měsíc(ů)","","2023-01-05T00:00:00","285.00","KS","3.00","4","2012-12-10T09:34:23.733","MAN","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328548_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328548_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328548_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328548_0d_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'1.033','length':'17','width':'13','height':'14'},'1':{'typ':'PACK','count':'12','weight':'13','length':'46','width':'29','height':'29'}}","N","","false",""),("328549","254015","MANHATTAN Stojan na 2 LCD monitory - kloubový","1258.00","1258.00","MAN","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","MANHATTAN","1269.00","1443.00","21.00","420808","false","0,00","Na objednávku","Manhattan","83024900","766623420808","MANHATTAN Stojan na 2 LCD monitory - kloubový","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Držiak na LCD monitor s dvojlinkovým výkyvným ramenom&lt;/strong&gt;&lt;br/&gt;Podporuje dva monitory, dvojlinkové výkyvné rameno&lt;/span&gt; &lt;ul&gt; &lt;li&gt;Spĺňa štandardy VESA - bezpečne drží dva LCD monitory od 13' do 24'&lt;/li&gt; &lt;li&gt;Umiestnenie monitorov nad pracovnú plochu s cieľom zväčšiť pracovný priestor, zlepšiť viditeľnosť a minimalizovať neporiadok&lt;/li&gt; &lt;li&gt;36' dvojité výkyvné ramená so samostatným 180° náklonom a 180° otáčaním&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;Zlepšite produktivitu a znížte záťaž&lt;br/&gt;Držiak na LCD monitory Manhattan s výkyvnými ramenami s dvojitým prepojením poskytuje bezpečnú a vyvýšenú polohu pre dva monitory s plochou obrazovkou a pomáha uvoľniť cenný pracovný stôl a pracovný priestor. Jeho plne nastaviteľné nastavenia sklonu, natočenia, natočenia do strán, výšky a napätia umožňujú pohodlné a produktívne sledovanie, ktoré pomáha znižovať únavu očí a namáhanie krku a chrbta. Monitory LCD možno ľahko otáčať okolo stĺpa, aby si ostatní mohli prezerať prezentácie a iné multimediálne zobrazenia takmer z akéhokoľvek smeru. &lt;p&gt;Robustná konštrukcia a jednoduchá inštalácia&lt;br/&gt;Odolná kovová konštrukcia z tlakového odliatku a robustná svorka umožňujú rýchle, jednoduché a bezpečné upevnenie na pracovný stôl alebo iný vodorovný povrch. Je kompatibilný so štandardom VESA a pripravený na inštaláciu pomocou dodaného hardvéru, takže nie je potrebné vŕtať diery do stolov alebo pracovných dosiek. &lt;p&gt;Doživotná záruka&lt;br/&gt;Prísne výrobné normy zaručujú najvyššiu kvalitu všetkých výrobkov Manhattan. Na všetky položky sa vzťahuje plná doživotná záruka - najsilnejší záväzok kvality, aký môže ktokoľvek prijať. &lt;p&gt;&lt;strong&gt;Funkcie&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Spĺňa štandardy VESA - bezpečne drží dva LCD monitory od 13' do 24'&lt;/li&gt; &lt;li&gt;Umiestnenie monitorov nad pracovnú plochu s cieľom zväčšiť pracovný priestor, zlepšiť viditeľnosť a minimalizovať neporiadok&lt;/li&gt; &lt;li&gt;36' dvojité výkyvné ramená so samostatným 180° náklonom a 180° otáčaním&lt;/li&gt; &lt;li&gt;Kovová tyč z tlakového odliatku s ťažkým držiakom svorky&lt;/li&gt; &lt;li&gt;Jednoduché nastavenie orientácie monitora do strán a nahor alebo nadol&lt;/li&gt; &lt;li&gt;Ideálne pre kancelárie, štúdiá, IT siete a bezpečnostné aplikácie&lt;/li&gt; &lt;li&gt;Jednoduchá inštalácia na akýkoľvek stôl alebo iný povrch - nie je potrebné vŕtanie&lt;/li&gt; &lt;li&gt;Spĺňa normy VESA&lt;/li&gt; &lt;li&gt;Doživotná záruka&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;strong&gt;ŠPECIFIKÁCIE&lt;/strong&gt; &lt;p&gt;&lt;strong&gt;Všeobecné&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Vhodný pre monitory s rozmermi 75 x 75 mm / 100 x 100 mm kompatibilné s VESA&lt;/li&gt; &lt;li&gt;Hmotnosť monitora: do 6 kg (13 libier)); 12 kg (26 libier.) celkom&lt;/li&gt; &lt;li&gt;Inštaluje sa na vodorovné povrchy do 7 cm (2.75 in.) hrubý&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;strong&gt;Rozmer&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Výška (pole): 41.3 cm (16.26 in.)&lt;/li&gt; &lt;li&gt;Priemer (pole): 2.9 cm (1.14 in.)&lt;/li&gt; &lt;li&gt;Dĺžka ramena (polomer): 39 cm (15.5 in.)&lt;/li&gt; &lt;li&gt;Šírka ramien (rozšírená): 92 cm (36 palcov).)&lt;/li&gt; &lt;li&gt;Hmotnosť: 4.6 kg (10.14 libier.)&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;strong&gt;Obsah balenia&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Stojan na LCD monitory s výkyvným ramenom s dvojitým prepojením&lt;/li&gt; &lt;li&gt;Spony na vedenie káblov a krytky obloženia&lt;/li&gt; &lt;li&gt;C-svorka so skrutkami s palcom (1)&lt;/li&gt; &lt;li&gt;Montážne skrutky monitora (8)&lt;/li&gt; &lt;li&gt;Inštalačný hardvér s návodom a šesťhranným nástrojom&lt;/li&gt; &lt;/ul&gt;.","false","22","000102230012","8475","3","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","1269.00","KS","0.00","4","2019-06-19T09:01:05.963","MAN","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328549_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328549_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328549_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328549_0d_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'4.642','length':'58.5','width':'29','height':'16'},'1':{'typ':'PACK','count':'4','weight':'19.58','length':'52','width':'31','height':'46'}}","N","","false",""),("354719","254171","MANHATTAN Nástěnný držák LCD / TV, kloubový s ramenem (±15°/180°, 13'-30', max. 15kg)","472.00","472.00","MAN","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","MANHATTAN","480.00","560.00","21.00","423700","false","0,00","Na objednávku","Manhattan","42021910","766623423700","MANHATTAN Nástěnný držák LCD / TV, kloubový s ramenem (±15°/180°, 13'-30', max. 15kg)","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Univerzálny kĺbový nástenný držiak na plochý televízor&lt;/strong&gt;&lt;br/&gt;s jedným ramenom, podporuje jeden 13' až 27' televízor do 15 kg.)&lt;/span&gt; &lt;ul&gt; &lt;li&gt;Bezpečne drží jeden plochý televízor&lt;/li&gt; &lt;li&gt;Optimalizujte pohľad pomocou nastavenia sklonu ± 15° a natočenia o 180°&lt;/li&gt; &lt;li&gt;Rozšíri TV až na 24.8 cm (9.76 in.) zo steny&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;Prekonajte zvláštny pôdorys, nepríjemné oslnenie alebo nevhodné umiestnenie nábytku, ktoré môže obmedzovať pôžitok z vášho plochého televízora. Univerzálny kĺbový nástenný držiak na plochý televízor Manhattan sa zlož