;p&gt;Univerzální hmoždinky FISCHER (typ UX) s pojistkou proti protočení v otvoru umožňují kotvení do plných, dutých i deskových stavebních materiálů:&lt;br /&gt;Beton&lt;br /&gt;Sádrokartonové a sádrovláknité desky&lt;br /&gt;Svisle děrované cihly&lt;br /&gt;Dutinové panely z lehčeného betonu&lt;br /&gt;Dutinové podlahové desky z cihel a betonu&lt;br /&gt;Děrované vápenopískové cihly&lt;br /&gt;Plné vápenopískové cihly&lt;br /&gt;Přírodní kámen&lt;br /&gt;Pórobeton&lt;/p&gt;","false","0","000101370019","9130","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","299.00","KS","4.00","1","2018-02-05T16:49:44.217","COI","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_880\/880181_0a_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'1.231','length':'24','width':'19','height':'5.5'},'1':{'typ':'PACK','count':'10','weight':'12.675','length':'39','width':'28','height':'26'},'2':{'typ':'PACK','count':'16','weight':'20.2','length':'44','width':'39','height':'26'}}","N","","false",""),("976333","1503323","HP Z2 Mini Arm/Wall VESA Mount Solution","466.00","466.00","HPC","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","HP PSG COMMERCIAL","469.00","558.00","21.00","Y7B61AA","false","0,00","","HP Inc.","84733080","190780544969","HP Z2 Mini Arm/Wall VESA Mount Solution","Typ příslušenství:Ostatní","1","Vložte počítač HP Z2 Mini do pouzdra a bezpečně jej připevněte za displej nebo na stěnu s možností uzamknutí pomocí volitelného zámku kabelu HP Ultra-Slim.","false","0","000100460008","494","-1","true","00020023","4122","-1","true","12","Měsíc(ů)","9H","0001-01-01T00:00:00","469.00","KS","0.00","2","2018-08-23T09:41:27.01","HPC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_976\/976333_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_976\/976333_0b_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11104'}}","{'0':{'typ':'JEDN','count':'1','weight':'2.05','length':'29','width':'31','height':'11'}}","N","","false",""),("1181071","496221","ARCTIC nástěnný držák na monitor W1A","284.00","284.00","ARC","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","ARCTIC","284.00","328.00","21.00","ORAEQ-MA005-GB","true","10-49","","Arctic Cooling","73262000","4895213700351","ARCTIC nástěnný držák na monitor W1A","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;strong&gt;W1A - Nástenný držiak monitora so systémom Quick-Fix&lt;/strong&gt; &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Nástenný držiak monitora so systémom Quick-Fix&lt;/strong&gt;&lt;br/&gt;ARCTIC W1A je jednootáčkový držiak s 3-osovým kĺbom, ktorý ponúka plynulé nastavenie uhla obrazovky s 360° rotáciou, 60° otočením a ±15° náklonom. Konštrukcia s guľovým kĺbom poskytuje flexibilitu na dokonalé umiestnenie monitora, aby sa znížilo namáhanie očí, krku, ramien a chrbta. Pripevňuje sa tesne k stene a maximalizuje pracovnú plochu. Dvojdielny systém priamej montáže, ktorý je kompatibilný s monitormi s uhlopriečkou od 13' do 43', umožňuje rýchlu inštaláciu a podporuje hmotnosť až do 20 kg. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Maximalizujte svoj priestor&lt;/strong&gt;&lt;br/&gt;Systém montáže monitora na stenu zaberá najmenej miesta na stole, a tak maximalizuje pracovnú plochu. Je tiež ideálnym riešením pre aplikácie s dotykovou obrazovkou. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Hladko prstom nastaviteľná obrazovka&lt;/strong&gt;&lt;br/&gt;Nástenný držiak ARCTIC W1A je integrovaný s hladkým guľôčkovým kĺbom, ktorý poskytuje najflexibilnejšie nastaviteľný uhol obrazovky s 360° otáčaním, 60° otáčaním doľava doprava a 15° nakláňaním dozadu a dozadu. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Nastavenie bez demontáže monitora&lt;/strong&gt;&lt;br/&gt;Pomocou montážnej hlavy W1A utiahnete alebo uvoľníte otočný mechanizmus podľa potreby len za niekoľko sekúnd. Monitor nie je potrebné demontovať. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;W1A Štandardné rameno monitora&lt;/strong&gt; &lt;br/&gt;Dokonalé polohovanie na zníženie namáhania očí, krku, ramien a chrbta&lt;br/&gt;Konštrukcia s guľovým kĺbom umožňuje jednoduché nastavenie prstami, čím poskytuje flexibilitu na nastavenie monitora do dokonalej polohy, a tým zabraňuje zbytočnému namáhaniu očí, krku, ramien a chrbta optimálnou polohou pri sledovaní. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Robustný a stabilný&lt;/strong&gt; &lt;br/&gt;Monitor ARCTIC W1A zabezpečuje bezpečný systém montáže na monitor. Je vybavený bezpečnostným zámkom a systémom dvoch skrutiek, ktoré zabraňujú skĺznutiu a zvyšujú stabilitu. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Dvojdielny systém priamej montáže Quick-Fix&lt;/strong&gt;&lt;br/&gt;Dvojdielny systém priamej montáže je určený na rýchlu a jednoduchú inštaláciu. Jednoducho priskrutkujte montáž na stenu a monitor, zostavte ho zasunutím do montážnej lišty. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Správa káblov&lt;/strong&gt;&lt;br/&gt;Jednoduchý dizajn háčika na správu káblov udržuje káble za monitorom úhľadne pohromade. &lt;p&gt;  &lt;p&gt;  &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE&lt;br/&gt;Kompatibilita: LCD/LED TV, stolné monitory a plazmové TV, ako sú LG, Viewsonic, HP, NEC, AOC a Dell&lt;br/&gt;Štandard VESA: 75/100&lt;br/&gt;Maximálna hmotnosť monitora: Max. 20 kg (44 libier)&lt;br/&gt;Veľkosť LCD: 13'-43'&lt;br/&gt;Farba: čierna&lt;br/&gt;Naklonenie: +/- 15°&lt;br/&gt;Otočenie: 60°&lt;br/&gt;Rotácia: 360°&lt;br/&gt;Rozmery balenia (D x V x Š): 186 x 131 85 mm&lt;br/&gt;Hmotnosť balenia: 0.899 kg&lt;br/&gt;Záruka: 2 roky&lt;br/&gt;Viac tech. informácie: &lt;a href='https://www.arctic.ac/eu_en/w1a.html'&gt;https://www&lt;/a&gt;.arktída.ac/eu_en/w1a.html&lt;/a&gt;.","false","0","00010232","8674","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","284.00","KS","17.00","12","2018-05-10T11:18:36.35","ARC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181071_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181071_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181071_0c_3.jpg','3':'https:\/\/c.