eda zlepšuje ergonomickú polohu sedenia vďaka ideálnemu nastaveniu podľa vašej individuálnej výšky očí. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Nastavenie bez demontáže monitora&lt;/strong&gt;&lt;br/&gt;Pomocou montážnej hlavy W1-3D utiahnete alebo uvoľníte otočný mechanizmus podľa potreby len za niekoľko sekúnd. Monitor nie je potrebné demontovať. &lt;p&gt;  &lt;p&gt;  &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE&lt;br/&gt;Kompatibilita&lt;br/&gt;Štandard VESA: 75 / 100&lt;br/&gt;Maximálna hmotnosť monitora: 8 kg / 17.6 libier na držiak&lt;br/&gt;Veľkosť LCD: 13' - 38'&lt;br/&gt;Farba: čierna&lt;br/&gt;Naklonenie: +/- 45°&lt;br/&gt;Otočenie: 180°&lt;br/&gt;Rotácia: 360°&lt;br/&gt;Rozmery balenia (D x V x Š): 434 x 129 x 85 mm&lt;br/&gt;Hmotnosť balenia: 2.04 kg&lt;br/&gt;Záruka: 2 roky&lt;br/&gt;Viac tech. informácie: &lt;a href='https://www.arctic.ac/eu_en/w1-3d.html'&gt;https://www&lt;/a&gt;.arktída.ac/eu_en/w1-3d.&lt;a&gt;html&lt;/a&gt;&lt;br/&gt;EAN: 872767008618.","false","0","00010232","8674","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","1142.00","KS","15.00","11","2018-05-10T13:31:25.22","ARC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0h_3.jpg','8':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0i_3.jpg','9':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0j_3.jpg','10':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181074_0k_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'2.024','length':'44','width':'9','height':