omické sedenie&lt;/strong&gt;&lt;br/&gt;Venujte pozornosť svojmu zdraviu aj v kancelárii. Takže Z1 Základná ergonomická poloha sedenia vďaka ideálnemu nastaveniu podľa vašej individuálnej výšky očí. &lt;p&gt;  &lt;p&gt;  &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE&lt;br/&gt;Kompatibilita&lt;br/&gt;Štandard VESA: 75 / 100&lt;br/&gt;Max. hmotnosť monitora:&lt;br/&gt;33 lbs&lt;br/&gt;Max. šírka monitora:&lt;br/&gt;-&lt;br/&gt;16:9 Veľkosť monitora:&lt;br/&gt;34'&lt;br/&gt;Veľkosť ultraširokého monitora:&lt;br/&gt;38'&lt;br/&gt;Hrúbka stolovej dosky:&lt;br/&gt;20 až 60 mm&lt;br/&gt;Náklon: +/- 15°&lt;br/&gt;Otočenie: 180°&lt;br/&gt;Rotácia: 360°&lt;br/&gt;Farba: čierna&lt;br/&gt;Hmotnosť výrobku: 2.1 kg&lt;br/&gt;Rozmery balenia (d x v x š): 430 x 140 x 81 mm&lt;br/&gt;Hmotnosť balenia: 2.44 kg&lt;br/&gt;Záruka: 2 roky&lt;br/&gt;Viac tech. informácie: &lt;a href='https://www.arctic.ac/eu_en/z1-basic.html'&gt;https://www&lt;/a&gt;.arktída.ac/eu_en/z1-basic.&lt;a&gt;html&lt;/a&gt;&lt;br/&gt;EAN: 872767008786.","false","0","","-1","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","563.00","KS","0.00","10","2018-05-11T13:36:19.613","ARC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181082_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181082_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181082_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181082_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181082_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181082_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181082_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181082_0h_3.jpg','8':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181082_0i_3.jpg','9':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1181\/1181082_0j_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'2.389','length':'42.5','width':'14','height':'8.5'},'1':{'typ':'PACK','count'