;  &lt;/table&gt;  &lt;p&gt;Link na výrobcu: &lt;a href='https://www.dell.com/en-ie/work/shop/dell-pro-stereo-soundbar-ae515m-skype-for-business-certified/apd/520-aanx/home-theater#techspecs_section' target='_blank'&gt;https://www.dell.com/en-ie/work/shop/dell-pro-stereo-soundbar-ae515m-skype-for-business-certified/apd/520-aanx/home-theater#techspecs_section&lt;/a&gt;&lt;/p&gt;","false","22","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","946.00","KS","1.00","5","2021-12-22T10:15:02.37","DLL","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1444\/1444778_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1444\/1444778_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1444\/1444778_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1444\/1444778_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1444\/1444778_0e_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11103'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.684','length':'47','width':'9','height':'9'}}","N","","false",""),("1446709","496572","ARCTIC stolní držák Z2 (Gen3) pro 2x LCD do 34', nosnost 2x15kg, 4x USB HUB, černý (black)","973.00","973.00","ARC","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","ARCTIC","973.00","1125.00","21.00","AEMNT00053A","true","7,00","","Arctic Cooling","73262000","4895213701280","ARCTIC stolní držák Z2 (Gen3) pro 2x LCD do 34', nosnost 2x15kg, 4x USB HUB, černý (black)","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Z2 (Gen 3) - Rameno na dva monitory s rozbočovačom USB&lt;/strong&gt;&lt;/span&gt; &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Získajte späť miesto na stole&lt;br/&gt;&lt;/strong&gt;Či už ho používate ako pracovnú stanicu alebo bojovú stanicu, rameno monitora ARCTIC Z2 je nástroj, ktorý potrebujete na to, aby ste mali na stole voľný priestor, čo vám umožní zvýšiť produktivitu a úroveň hrania hier. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Optimalizovaná ergonómia&lt;/strong&gt;&lt;br/&gt;Ak trávite veľa času pred obrazovkou, rýchlo oceníte ergonomické výhody modelu Z2, najmä možnosť prispôsobiť si uhol pohľadu. Nájdenie optimálneho nastavenia obrazoviek zlepšuje držanie tela. Či už chcete nastaviť výšku, uhol alebo orientáciu obrazovky, zariadenie Z2 zlepšuje ergonomické možnosti vášho stola a kancelárskej stoličky a ponúka vám pohodlie a prispôsobivosť. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Vhodné aj pre ultraširokouhlé monitory&lt;/strong&gt;&lt;br/&gt;Rameno monitora ARCTIC Z2 bez problémov podporuje najnovšie ultraširokouhlé monitory (do 29 palcov). &lt;br/&gt;Kompatibilné sú aj klasické monitory s pomerom strán 16:9 (do 34 palcov). Z2 unesie celkovú záťaž 15 kg/33 libier. &lt;p&gt;&lt;br/&gt;&lt;strong&gt;Optimálne zarovnanie&lt;/strong&gt;&lt;br/&gt;Montážna hlava ARCTIC Z2 umožňuje jednoduchú inštaláciu a následné zmeny zarovnania. Nezáleží na tom, či chcete monitor mierne nakloniť alebo otočiť o 180 stupňov - jediné nástroje, ktoré potrebujete, sú vaše ruky. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Rozbočovač USB&lt;br/&gt;&lt;/strong&gt;Štýlový 2.0 Rozbočovač USB prináša štyri porty priamo tam, kde ich najviac potrebujete - na vašom stole. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Manažment káblov&lt;br/&gt; Máte už dosť&lt;/strong&gt;káblovej spleti? Vďaka dodávanému manažmentu káblov v Z2 sú neposlušné káble minulosťou. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Jednoduché a rýchle nastavenie&lt;br/&gt;&lt;/strong&gt;Stačí niekoľko jednoduchých krokov a dodané nástroje a zariadenie Z2 je v okamihu pripravené na použitie na vašom stole.&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;  &lt;p&gt;&lt;span style='font-size: 14pt;'&gt;&lt;strong&gt;Technické špecifikácie&lt;/strong&gt;&lt;/span&gt; &lt;p&gt;&lt;strong&gt;Materiál: &lt;/strong&gt;oceľ, hliníková zliatina ADC12&lt;br/&gt;&lt;strong&gt;Farba:&lt;/strong&gt; matná čierna&lt;br/&gt;&lt;strong&gt;Naklonenie:&lt;/strong&gt; +/- 15°&lt;br/&gt;&lt;strong&gt;Otočenie:&lt;/strong&gt; 180°&lt;br/&gt;&lt;strong&gt;Rotácia:&lt;/strong&gt; 360°&lt;br/&gt;&lt;strong&gt;Štandard VESA:&lt;/strong&gt; 75 / 100&lt;br/&gt;&lt;strong&gt;Maximálna hmotnosť monitora:&lt;/strong&gt; 15 kg (33 libier) na jeden držiak&lt;br/&gt;&lt;strong&gt;Veľkosť monitora Classis 16:9:&lt;/strong&gt; do 34&lt;strong&gt;'&lt;/strong&gt;&lt;br/&gt;&lt;strong&gt;Veľkosť ultrawide monitora:&lt;/strong&gt; do 29'&lt;br/&gt;&lt;strong&gt;Kompatibilita:&lt;/strong&gt; Windows 10, 8,1, 7, Vista, XP; macOS; Linux&lt;br/&gt;&lt;strong&gt;Porty:&lt;/strong&gt; 4x USB 2.0&lt;br/&gt;&lt;strong&gt;Dĺžka kábla:&lt;/strong&gt; 2 m&lt;br/&gt;&lt;strong&gt;Výstupné&lt;/strong&gt; napätie: 5 V DC , max. 500 mA&lt;br/&gt;&lt;strong&gt;Záruka:&lt;/strong&gt; 2 roky.","false","0","00010232","8674","-1","true","","-1","-1","true","24","Měsíc(ů)","","2023-01-10T12:12:00","973.00","KS","7.00","12","2019-02-07T10:09:57.267","ARC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0h_3.jpg','8':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0i_3.jpg','9':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0j_3.jpg','10':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0k_3.jpg','11':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1446\/1446709_0l_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'3.969','length':'43','width':'31','height':'8'},'1':{'typ':'PACK','count':'3','weight':'12.3','length':'34','width':'26','height':'46'},'2':{'typ':'PACK','count':'5','weight':'20.745','length':'42.5','width':'32.5','heigh