onitor mierne nakloniť alebo otočiť o 180 stupňov - jediné nástroje, ktoré potrebujete, sú vaše ruky. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Rozbočovač USB&lt;br/&gt;&lt;/strong&gt;Štýlový 3.0 Rozbočovač USB prináša štyri porty priamo tam, kde ich najviac potrebujete - na vašom stole. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Manažment káblov&lt;br/&gt; Máte už dosť&lt;/strong&gt;káblovej spleti? Vďaka dodávanému manažmentu káblov v Z2 Pro sú neposlušné káble minulosťou. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Jednoduché a rýchle nastavenie&lt;br/&gt;&lt;/strong&gt;Vďaka niekoľkým jednoduchým krokom a priloženým nástrojom je Z2 Pro pripravený na použitie na vašom stole za okamih.&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;  &lt;br/&gt; &lt;p&gt;&lt;span style='font-size: 14pt;'&gt;&lt;strong&gt;TECHNICKÉ ŠPECIFIKÁCIE&lt;/strong&gt;&lt;/span&gt; &lt;p&gt;&lt;strong&gt;Materiál: &lt;/strong&gt;oceľ, hliníková zliatina ADC12&lt;br/&gt;&lt;strong&gt;Farba:&lt;/strong&gt; matná čierna&lt;br/&gt;&lt;strong&gt;Naklonenie:&lt;/strong&gt; +/- 15°&lt;br/&gt;&lt;strong&gt;Otočenie:&lt;/strong&gt; 180°&lt;br/&gt;&lt;strong&gt;Rotácia:&lt;/strong&gt; 360°&lt;br/&gt;&lt;strong&gt;Štandard VESA:&lt;/strong&gt; 75 / 100&lt;br/&gt;&lt;strong&gt;Maximálna hmotnosť monitora:&lt;/strong&gt; 15 kg (33 libier) na jeden držiak&lt;br/&gt;&lt;strong&gt;Veľkosť monitora Classis 16:9:&lt;/strong&gt; do 34&lt;strong&gt;'&lt;/strong&gt;&lt;br/&gt;&lt;strong&gt;Veľkosť ultrawide monitora:&lt;/strong&gt; do 29'&lt;br/&gt;&lt;strong&gt;Kompatibilita:&lt;/strong&gt; Windows 10, 8,1, 7, Vista, XP; macOS; Linux&lt;br/&gt;&lt;strong&gt;Porty:&lt;/strong&gt; 4, USB 3.0, s napájacím vstupom Micro USB&lt;br/&gt;&lt;strong&gt;Dĺžka kábla:&lt;/strong&gt; 2 m&lt;br/&gt;&lt;strong&gt;Výstupné&lt;/strong&gt; napätie&lt;strong&gt;:&lt;/strong&gt; 5 V DC , max. 500 mA&lt;br/&gt;&lt;strong&gt;Záruka:&lt;/strong&gt; 2 roky.","false","0","00010232","8674","-1","true","","-1","-1","true","24","Měsíc(ů)","","2023-01-10T12:12:00"