možňující  snadnou demontáž pomocí bočních průhledných lístků. Ergonomická zóna  ZÓNA 3 – předcházejte bolesti šíje a krční páteře. Velikost filtru  15,6', poměry stran 16:9, barva černá, rozměry (šxv) 346×195 mm.","false","0","000102650008","10395","-1","true","00020268","11241","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","890.00","KS","0.00","1","2019-03-03T22:37:23.63","FEL","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1451\/1451048_0a_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'14055'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.256','length':'39','width':'27','height':'0.5'}}","N","","false",""),("1451858","254742","MANHATTAN stojan, LCD držák, jeden monitor","562.30","564.00","MAN","1.70","0.00","0.000000","0.000","24 Měsíc(ů)","MANHATTAN","572.00","667.00","21.00","423786","false","0,00","","Manhattan","85176200","766623423786","MANHATTAN stojan, LCD držák, jeden monitor","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;strong&gt;Pól pre LCD monitor&lt;br/&gt;&lt;/strong&gt;Podporuje jeden monitor, dvojité výkyvné rameno &lt;ul&gt; &lt;li&gt;Bezpečne drží jeden LCD monitor nad pracovnou plochou, aby sa zväčšil pracovný priestor a minimalizoval neporiadok&lt;/li&gt; &lt;li&gt;Dvojlinkové výkyvné rameno optimalizuje ergonómiu a zobrazenie monitora s možnosťou nastavenia sklonu ±15°, otočenia o 180° a výšky&lt;/li&gt; &lt;li&gt;Odolná oceľová a hliníková konštrukcia so silnou svorkou sa upevňuje na stôl alebo iný vodorovný povrch&lt;/li&gt; &lt;li&gt;Jednoduchá inštalácia ideálna pre domáce, kancelárske a komerčné aplikácie - nie je potrebné vŕtanie&lt;/li&gt; &lt;li&gt;Spĺňa štandardy VESA - je vhodný pre monitory s uhlopriečkou od 13' do 27' a hmotnosťou do 15 kg (33 libier).)&lt;/li&gt; &lt;li&gt;Doživotná záruka&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;strong&gt;PREHĽAD&lt;/strong&gt; &lt;p&gt;&lt;br/&gt;Stojany na LCD monitory pomáhajú využiť pracovný priestor, zlepšujú ergonómiu a zdieľajú pohľad.&lt;br/&gt;Manhattanský stojan na LCD monitory s dvojzväzkovým výkyvným ramenom poskytuje bezpečnú a vyvýšenú polohu pre jeden plochý displej, ktorý pomáha udržať cenný pracovný stôl a pracovný priestor voľný a nezaberá miesto. Jeho plne nastaviteľné nastavenia sklonu, natočenia, natočenia do strán, výšky a napätia umožňujú pohodlnú a produktívnu pozíciu na sledovanie, ktorá pomáha znižovať únavu očí a znižuje napätie krku a chrbta, čím sa zvyšuje produktivita. Displej LCD sa dá ľahko otáčať okolo tyče, aby ho ostatní mohli sledovať takmer z akéhokoľvek smeru. Odolná konštrukcia a robustná svorka umožňujú rýchle, jednoduché a bezpečné upevnenie na pracovnú plochu alebo iný vodorovný povrch. Vďaka kompatibilite so štandardom VESA a pripravenosti na inštaláciu s dodaným hardvérom nie je potrebné vŕtať diery do stolov alebo pracovných dosiek, aby ste mali lepší výhľad dopredu a do stredu. &lt;p&gt;&lt;strong&gt;Špecifikácie&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Vhodný pre monitory s rozmermi 75 x 75, 100 x 100 mm kompatibilné s VESA od 13' do 27'&lt;/li&gt; &lt;li&gt;Hmotnosť monitora: do 15 kg (33 libier))&lt;/li&gt; &lt;li&gt;Výška stĺpa: 400 mm (15.7 in.)&lt;/li&gt; &lt;li&gt;Rozšírenie: 5 až 439 mm (0.2 až 17 palcov.)&lt;/li&gt; &lt;li&gt;Hmotnosť jednotky: 2.8 kg (6.2 libry.)&lt;/li&gt; &lt;li&gt;Obsah balenia&lt;/li&gt; &lt;li&gt;Stojan na LCD monitory s výkyvným ramenom s dvojitým prepojením&lt;/li&gt; &lt;li&gt;Inštalačný hardvér s pokynmi&lt;/li&gt; &lt;/ul&gt;.","false","0","000102230017","9021","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","572.00","KS","0.00","3","2019-03-12T11:03:21.743","MAN","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1451\/1451858_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1451\/1451858_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1451\/1451858_0c_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'2.79','length':'55','width':'8.5','height':'30'},'1':{'typ':'PACK','count':'6','weight':'17.82','length':'53','width':'32','height':'57'}}","N","","false",""),("1451873","254752","MANHATTAN Nástěnný držák LCD / TV, kloubový, 13” až 27”, 15 kg","434.30","436.00","MAN","1.70","0.00","0.000000","0.000","24 Měsíc(ů)","MANHATTAN","442.00","521.00","21.00","460958","false","0,00","Na objednávku","Manhattan","85176200","766623460958","MANHATTAN Nástěnný držák LCD / TV, kloubový, 13” až 27”, 15 kg","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;strong&gt;Univerzálny kĺbový nástenný držiak na plochý televízor&lt;br/&gt;&lt;/strong&gt;Dvojité rameno, podporuje jeden 13' až 27' televízor do 15 kg.)&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Bezpečne drží jeden plochý televízor&lt;/li&gt; &lt;li&gt;Optimalizujte pohľad pomocou nastavenia sklonu ± 70° a natočenia ± 90°&lt;/li&gt; &lt;li&gt;Rozšíri TV až na 38.2 cm (15.05 in.) zo steny&lt;/li&gt; &lt;li&gt;Odolná hliníková konštrukcia&lt;/li&gt; &lt;li&gt;Jednoduchá inštalácia ideálna pre domáce, kancelárske a komerčné aplikácie&lt;/li&gt; &lt;li&gt;Zabudovaný systém vedenia káblov a integrovaná bublinková vodováha&lt;/li&gt; &lt;li&gt;Spĺňa štandardy VESA - podporuje televízory s uhlopriečkou od 13' do 27' do 15 kg.)&lt;/li&gt; &lt;li&gt;Doživotná záruka&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;strong&gt;PREHĽAD&lt;br/&gt;&lt;/strong&gt;&lt;strong&gt;&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; Prekonajte zvláštny pôdorys, nepríjemné oslnenie alebo nevhodné umiestnenie nábytku, ktoré môže obmedzovať pôžitok z vášho plochého televízora.&lt;/strong&gt; Univerzálny nástenný držiak Manhattan na plochý televízor sa zloží takmer naplocho k stene a bezpečne sa vysunie na silnom dvojitom ramene, aby vám pomohol dosiahnuť najlepšie pozície na sledovanie takmer z ktoréhokoľvek miesta v miestnosti. Tento kĺbový nástenný držiak je kompatibilný so štandardom VESA a je vyrobený z kvalitných materiálov, takže sa hodí pre rôzne veľkosti displejov a umožňuje bezpečnú a istú inštaláciu televízora nad podlahou. Perfektne sa hodí na montáž televízora v obývacej izbe, spálni alebo pracovni, ako aj na komerčné použitie v hoteloch, učebniach, konferenčných miestnostiach, na digitálnu reklamu a podobne. Univerzálny nástenný držiak na plochý televízor Manhattan, nech ho nainštalujete kamkoľvek, vám poskytne najlepší zážitok zo sledovania televízora.&lt;strong&gt;&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt;&lt;/strong&gt; &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Špecifikácie&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Vhodný pre televízory s rozmermi 75x75 alebo 100x100 kompatibilné so štandardom VESA&lt;/li&gt; &lt;li&gt;Nosnosť: do 15 kg (33 libier))&lt;/li&gt; &lt;li&gt;Roztiahne sa na 55 až 382 mm (2.17 až 15 palcov.)&lt;/li&gt; &lt;li&gt;Obsah balenia&lt;/li&gt; &lt;li&gt;Univerzálny kĺbový nástenný držiak na plochý televízor&lt;/li&gt; &lt;li&gt;Inštalačný hardvér s pokynmi&lt;/li&gt; &lt;li&gt;Hmotnosť: 1.1 kg&lt;/li&gt; &lt;/ul&gt;.","false","22","000102230017","9021","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","442.00","KS","0.00","3","2019-03-12T12:28:15.92","MAN","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1451\/1451873_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1451\/1451873_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1451\/1451873_0c_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'1.091','length':'24','width':'15.5','height':'6'},'1':{'typ':'PACK','count':'12','weight':'13.57','length':'40','width':'33','height':'26'}}","N","","false",""),("1452017","254756","MANHATTAN stolní držák pro 2xLCD, 13' až 32', černý","765.30","767.00","MAN","1.70","0.00","0.000000","0.000","24 Měsíc(ů)","MANHATTAN","779.00","897.00","21.00","461528","false","0,00","Na objednávku","Manhattan","85176200","766623461528","MANHATTAN Stolní držák pro 2xLCD, 13' až 32', černý","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;strong&gt;Univerzálny držiak na dva monitory s dvojlinkovým výkyvným ramenom&lt;br/&gt;&lt;/strong&gt;Udrží dva 13' až 32' LCD monitory s hmotnosťou do 8 kg (17 libier).), Čierna&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Umiestnenie monitorov nad pracovnú plochu s cieľom zväčšiť pracovný priestor, zlepšiť viditeľnosť a minimalizovať neporiadok&lt;/li&gt; &lt;li&gt;Dvojité výkyvné ramená so samostatným náklonom ±45°, otáčaním ±180° a variabilným nastavením výšky&lt;/li&gt; &lt;li&gt;Oceľový stĺp s ťažkým držiakom svorky&lt;/li&gt; &lt;li&gt;Odnímateľné dosky VESA, vďaka ktorým je upevnenie monitora rýchlejšie a jednoduchšie&lt;/li&gt; &lt;li&gt;Jednoduché nastavenie polohy monitora&lt;/li&gt; &lt;li&gt;Ideálne pre kancelárie, štúdiá, IT siete a bezpečnostné aplikácie&lt;/li&gt; &lt;li&gt;Jednoduchá inštalácia na akýkoľvek stôl alebo iný povrch - nie je potrebné vŕtanie&lt;/li&gt; &lt;li&gt;Doživotná záruka&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;strong&gt;PREHĽAD&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;&lt;br/&gt;Správa pracovnej plochy. Maximalizujte produktivitu.&lt;br/&gt;Inštalácia LCD monitora nad pracovný stôl pomáha maximalizovať efektívnosť potenciálneho pracovného priestoru. Univerzálny držiak na dva monitory Manhattan s dvojlinkovým výkyvným ramenom zlepšuje organizáciu na pracovnej ploche a uľahčuje prácu na počítači. &lt;p&gt;Tento držiak na dva monitory je vyrobený z odolnej ocele a má robustnú svorku, ktorá umožňuje rýchlu, jednoduchú a bezpečnú montáž bez potreby vŕtania dier do stolov alebo pracovných dosiek. Jeho plne nastaviteľné nastavenia sklonu, otáčania, natáčania do strán, výšky a napnutia vytvárajú dokonalú polohu na pohodlné zvýšenie produktivity. Takéto možnosti nastavenia môžu dokonca pomôcť znížiť únavu očí alebo namáhanie krku a chrbta. Okrem toho stĺpik držiaka umožňuje jednoduché otáčanie monitora, aby mohli ostatní sledovať prezentácie a multimediálne produkcie takmer z ľubovoľného smeru.&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;&lt;strong&gt;&lt;strong&gt;&lt;br/&gt;ŠPECIFIKÁCIE&lt;/strong&gt;&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Vhodný pre monitory s rozmermi 75 x 75 mm / 100 x 100 mm kompatibilné s VESA&lt;/li&gt; &lt;li&gt;Hmotnosť monitora: do 8 kg (17 libier).) každý&lt;/li&gt; &lt;li&gt;Inštaluje sa na vodorovné povrchy od 10 do 85 mm (0.4 - 3.3 in.) hrubý&lt;/li&gt; &lt;li&gt;Rozmery&lt;/li&gt; &lt;li&gt;Výška (tyč): 443 mm (17.4 in.)&lt;/li&gt; &lt;li&gt;Dĺžka ramena (polomer): 399 mm (15.7 in.)&lt;/li&gt; &lt;li&gt;Šírka ramena (rozšírená): 798 mm (31.4 in.)&lt;/li&gt; &lt;li&gt;Obsah balenia&lt;/li&gt; &lt;li&gt;Univerzálny držiak na dva monitory s dvojramennými výkyvnými ramenami&lt;/li&gt; &lt;li&gt;Spony na vedenie káblov a krytky obloženia&lt;/li&gt; &lt;li&gt;C-svorka so skrutkou s palcom&lt;/li&gt; &lt;li&gt;Montážne a montážne skrutky monitora&lt;/li&gt; &lt;li&gt;Inštalačný hardvér s návodom a šesťhranným nástrojom&lt;/li&gt; &lt;li&gt;Hmotnosť: 4.32 kg&lt;/li&gt; &lt;li&gt;Rozmery: 76 (D) x 798 (Š) x 548 (V) [mm]&lt;/li&gt; &lt;/ul&gt;.","false","22","000102230017","9021","-1","true","","-1","-1","true","24","Měsíc(ů)","","2023-01-05T00:00:00","779.00","KS","0.00","3","2019-03-13T11:39:26.837","MAN","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1452\/1452017_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1452\/1452017_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1452\/1452017_0c_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'4.72','length':'49','width':'19','height':'12.5'},'1':{'typ':'PACK','count':'4','weight':'19.65','length':'51','width':'39','height':'27'}}","N","","false",""),("1455918","416508","NEC SST Pen-Eraser Kit - Set of pen and eraser for NEC large format ShadowSense touch displays","670.00","670.00","NEC","0.00","0.00","0.000000","0.000","36 Měsíc(ů)","NEC","699.00","728.00","21.00","100015068","false","0,00","","NEC","73269098","","NEC SST Pen-Eraser Kit - Set of pen and eraser for NEC large format ShadowSense touch displays","Typ příslušenství:Ostatní","1","NEC SST Pen-Eraser Kit - Set of pen and eraser for NEC large format ShadowSense touch displays    Description  Leave Your Mark  The NEC ShadowSense™ Pen and Eraser Kit is custom-engineered to provide you with the closest feeling to writing on paper, yet with no batteries or electronics to worry about.  The kit combines the performance benefits of an active stylus with the simplicity of a passive system. Integrated magnets in both, the pen and eraser, allow for easy mounting on your NEC ShadowSense Touch display and helps you keep your meeting room clean and clutter-free.    Benefits  ?The kit works seamlessly with ShadowSense Touch technology and offers a paper-like intuitive writing experience.  ?The precision pen  instantly eliminates unintentional connection strokes, whilst the precisiion eraser eliminates accidental erasing.  ?Benefit from automatic recognition of interactions whether touch gestures, pen writing or easing.  ?With native Windows Ink support for ShadowSense Touch technology, functionality can be used with PowerPoint, OneNote and many more.","false","0","","-1","-1","true","000202560008","10530","-1","true","36","Měsíc(ů)","","0001-01-01T00:00:00","699.00","KS","0.00","2","2019-04-12T13:07:51.683","NEC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1455\/1455918_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1455\/1455918_0b_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11104'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("1455935","416514","NEC 40' Freestand Storage-Black-Signage Indoor stojan,cierny, pre V404,P404, pre finalizaciu ponuky, kontaktujte PM","41528.00","41528.00","NEC","0.00","0.00","0.000000","0.000","36 Měsíc(ů)","NEC","42297.00","44220.00","21.00","100014938","false","0,00","","NEC","73269098","","NEC 40' Freestand Storage-Black-Signage Indoor stojan,cierny, pre V404,P404, pre finalizaciu ponuky, kontaktuj