','width':'0','height':'0'}}","N","","false",""),("1456187","496608","ARCTIC stolní držák Z1 (Gen.3) pro 1x LCD do 43', nosnost 15kg, USB HUB, černý (black)","786.00","786.00","ARC","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","ARCTIC","786.00","909.00","21.00","AEMNT00052A","false","0,00","","Arctic Cooling","73262000","4895213701273","ARCTIC stolní držák Z1 (Gen.3) pro 1x LCD do 43', nosnost 15kg, USB HUB, černý (black)","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;strong&gt;Z1 (Gen3) - Rameno na montáž monitora na stôl s rozbočovačom USB&lt;/strong&gt; &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Získajte späť miesto na stole&lt;/strong&gt;&lt;br/&gt;Či už ho používate ako pracovnú stanicu alebo bojovú stanicu, rameno monitora ARCTIC Z1 je nástroj, ktorý potrebujete na to, aby ste mali na stole voľný priestor, čo vám umožní zvýšiť produktivitu a úroveň hrania hier. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Optimalizovaná ergonómia&lt;/strong&gt;&lt;br/&gt;Ak trávite veľa času pred obrazovkou, rýchlo oceníte ergonomické výhody modelu Z1, najmä možnosť prispôsobiť si uhol pohľadu. Nájdenie optimálneho nastavenia obrazoviek zlepšuje držanie tela. Či už chcete nastaviť výšku, uhol alebo orientáciu obrazovky, zariadenie Z1 zlepšuje ergonomické možnosti vášho stola a kancelárskej stoličky a ponúka vám pohodlie a prispôsobivosť. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Vhodné aj pre ultraširokouhlé monitory&lt;/strong&gt;&lt;br/&gt;Rameno monitora ARCTIC Z1 bez problémov podporuje najnovšie ultraširokouhlé monitory (do 49 palcov). &lt;br/&gt;Kompatibilné sú aj klasické monitory s pomerom strán 16:9 (do 43 palcov). Z1 unesie celkovú záťaž 15 kg/33 libier. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Optimálne zarovnanie&lt;/strong&gt;&lt;br/&gt;Montážna hlava ARCTIC Z1 umožňuje jednoduchú inštaláciu a následné zmeny zarovnania. Nezáleží na tom, či chcete monitor mierne nakloniť alebo otočiť o 180 stupňov - jediné nástroje, ktoré potrebujete, sú vaše ruky. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Rozbočovač USB&lt;/strong&gt;&lt;br/&gt;Štýlový 2.0 Rozbočovač USB prináša štyri porty priamo tam, kde ich najviac potrebujete - na vašom stole. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Manažment káblov&lt;/strong&gt;&lt;br/&gt;Máte už dosť káblovej spleti? Vďaka dodávanému manažmentu káblov v Z1 sú neposlušné káble minulosťou. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Jednoduché a rýchle nastavenie&lt;/strong&gt;&lt;br/&gt;Stačí niekoľko jednoduchých krokov a dodané náradie a Z1 je v okamihu pripravený na použitie na vašom stole. &lt;br/&gt; &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE&lt;br/&gt;Materiál: Oceľ, hliníková zliatina ADC12&lt;br/&gt;Farba: Matná čierna&lt;br/&gt;Naklonenie: +/- 15°&lt;br/&gt;Otočenie: 180°&lt;br/&gt;Rotácia: 360°&lt;br/&gt;KOMPATIBILITA&lt;br/&gt;Štandard VESA: 75 / 100&lt;br/&gt;Maximálna hmotnosť monitora: 15 kg (33 libier) na jeden držiak&lt;br/&gt;Veľkosť monitora Classis 16:9: do 43'&lt;br/&gt;Veľkosť ultrawide monitora: do 49'&lt;br/&gt;USB Hub&lt;br/&gt;Kompatibilita: Windows 10, 8,1, 7, Vista, XP, macOS, Linux&lt;br/&gt;Porty: 4x USB 2.0&lt;br/&gt;Dĺžka kábla: 2 m&lt;br/&gt;Výstupné napätie: 5 V DC, max. 500 mA&lt;br/&gt;Hmotnosť výrobku: 2.70 kg&lt;br/&gt;Rozmery balenia (d x v x š): 426 x 134 x 93 mm&lt;br/&gt;Hmotnosť balenia: 2.43 kg&lt;br/&gt;Záruka: 2 roky&lt;br/&gt;Viac tech. informácie: &lt;a href='https://www.arctic.ac/eu_en/z1-gen-3.html'&gt;https://www&lt;/a&gt;.arktída.ac/eu_en/z1-gen-3.html&lt;/a&gt;.","false","0","","-1","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","786.00","KS","0.00","16","2019-04-15T16:10:56.123","ARC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1456\/1456187_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1456\/1456187_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1456\/1456187_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1456\/1456187_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1456\/1456187_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1456\/1456187_0f_3.jp