icu, rameno monitora ARCTIC Z1 Pro je nástroj, ktorý potrebujete na to, aby ste mali na stole voľný priestor, čo vám umožní zvýšiť produktivitu a úroveň hrania hier. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Optimalizovaná ergonómia&lt;/strong&gt;&lt;br/&gt;Ak trávite veľa času pred obrazovkou, rýchlo oceníte ergonomické výhody modelu Z1 Pro, najmä možnosť prispôsobiť si uhol pohľadu. Nájdenie optimálneho nastavenia obrazoviek zlepšuje držanie tela. Či už chcete nastaviť výšku, uhol alebo orientáciu obrazovky, zariadenie Z1 Pro zlepšuje ergonomické možnosti vášho stola a kancelárskej stoličky a ponúka vám pohodlie a prispôsobivosť. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Vhodné aj pre ultraširokouhlé monitory&lt;br/&gt;&lt;/strong&gt;Rameno monitora ARCTIC Z1 Pro bez problémov podporuje najnovšie ultraširokouhlé monitory (do 38 palcov). Kompatibilné sú aj klasické monitory s pomerom strán 16:9 (do 34 palcov). Z1 Pro unesie celkovú záťaž 15 kg/33 libier. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Optimálne zarovnanie&lt;/strong&gt;&lt;br/&gt;Montážna hlava ARCTIC Z1 Pro umožňuje jednoduchú inštaláciu a následné zmeny zarovnania. Nezáleží na tom, či chcete monitor mierne nakloniť alebo otočiť o 180 stupňov - jediné nástroje, ktoré potrebujete, sú vaše ruky. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Rozbočovač USB&lt;/strong&gt;&lt;br/&gt;Štýlový rozbočovač USB SuperSpeed prináša štyri porty priamo tam, kde ich najviac potrebujete - na váš stôl. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Manažment káblov&lt;/strong&gt;&lt;br/&gt;Máte už dosť káblovej spleti? Vďaka dodávanému manažmentu káblov v Z1 Pro sú nepoddajné káble minulosťou. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Jednoduché a rýchle nastavenie&lt;/strong&gt;&lt;br/&gt;Vďaka niekoľkým jednoduchým krokom a priloženým nástrojom je Z1 Pro pripravený na použitie na vašom stole za okamih. &lt;p&gt;&lt;br/&gt; &lt;p&gt;  &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE&lt;br/&gt;Materiál: Oceľ, hliníková zliatina ADC12&lt;br/&gt;Farba: Matná čierna&lt;br/&gt;Naklonenie: +/- 15°&lt;br/&gt;Otočenie: 180°&lt;br/&gt;Rotácia: 360° &lt;p&gt;KOMPATIBILITA&lt;br/&gt;Štandard VESA: 75 / 100&lt;br/&gt;Maximálna hmotnosť monitora: 15 kg (33 libier) na jeden držiak&lt;br/&gt;Veľkosť monitora Classis 16:9: do 34'&lt;br/&gt;Veľkosť ultrawide monitora: do 38'&lt;br/&gt;Rozbočovač USB&lt;br/&gt;Kompatibilita: Windows 10, 8,1, 7, Vista, XP, macOS, Linux&lt;br/&gt;Porty: 4, USB 3.2 Gen 1, s DC napájacím konektorom&lt;br/&gt;Dĺžka kábla: 2 m&lt;br/&gt;Hmotnosť výrobku: 2.90 kg&lt;br/&gt;Napájací výstup:&lt;br/&gt;5 V DC, 900 mA/Port, Max. 900 mA (bez napájacieho zdroja) 5 V DC, 900 mA/Port, Max. 2 900 mA (s napájacím zdrojom)&lt;br/&gt;Príkon:&lt;br/&gt;5 V DC, 2 A A&lt;br/&gt;Hmotnosť balenia: 3.5 kg&lt;br/&gt;Záruka: 2 roky&lt;br/&gt;Viac tech. informácie: &lt;a href='https://www.arctic.ac/en/Z1-Pro-Gen-3/AEMNT00049A'&gt;https://www&lt;/a&gt;.arktída.ac/en/Z1-Pro-Gen-3/AEMNT00049A&lt;/a&gt;.","false","0","","-1","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","1273.00","KS","1.00","17","2019-05-16T11:15:12.143","ARC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0h_3.jpg','8':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0i_3.jpg','9':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0j_3.jpg','10':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0k_3.jpg','11':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0l_3.jpg','12':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0m_3.jpg','13':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0n_3.jpg','14':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0o_3.jpg','15':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0p_3.jpg','16':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1461\/1461567_0q_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'3.502','length':'43','width':'14.5','height':'14'},'1':{'typ':'PACK','count':'4','weight':'14.785','length':'56','width':'17','height':'46'}}","N","","false",""),("1467718","496643","ARCTIC držák na monitor Z2-3D (gen.3)","2242.00","2242.00","ARC","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","ARCTIC","2242.00","2911.00","21.00","AEMNT00057A","true","2,00","","Arctic Cooling","73262000","4895213701785","ARCTIC držák na monitor Z2-3D (gen.3)","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;strong&gt;Z2-3D (gen.3)&lt;br/&gt;Plynové rameno s dvojitým monitorom na stôl&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;&lt;strong&gt;Úplná mobilita pre väčšie pohodlie&lt;br/&gt;&lt;/strong&gt;Vďaka technológii plynového zdvihu modelu Z2-3D (Gen 3) možno obrazovku plynulo vytiahnuť alebo odsunúť a voľne ju vertikálne posúvať.&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Ergonomické polohovanie obrazovky&lt;br/&gt;&lt;/strong&gt;Naše ramená monitora sú výškovo nastaviteľné a umožňujú vám jednoducho nastaviť obrazovku do ideálneho ergonomického nastavenia. Horná časť obrazovky by mala byť tesne pod úrovňou očí.&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Práca s viacerými monitormi&lt;br/&gt;&lt;/strong&gt;Pridajte druhú obrazovku a zvýšte svoju produktivitu pomocou ramena monitora Z2-3D (Gen 3). &lt;p&gt;&lt;strong&gt;Vylepšený pracovný priestor&lt;br/&gt;&lt;/strong&gt;Rameno monitora Z2-3D (Gen 3) pomáha udržiavať poriadok na stole a vytvára viac cenného priestoru na dôležité veci. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Rozbočovač SuperSpeed USB&lt;br/&gt;&lt;/strong&gt;Rozbočovač SuperSpeed USB poskytuje pohodlné miesto na stole na pripojenie zariadení USB, aby ste mali svoje miniaplikácie vždy na dosah. Súčasne možno pripojiť až štyri zariadenia.&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Kompatibilita s ultraširokým monitorom&lt;br/&gt;&lt;/strong&gt;Rameno monitora ARCTIC Z2-3D (Gen 3) bez problémov podporuje najnovšie ultraširoké monitory (do 29 palcov). Kompatibilné sú aj klasické monitory s pomerom strán 16:9 (do 34 palcov). Z2-3D (Gen 3) podporuje monitory s hmotnosťou 8 kg/17.6 libier na rameno.&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Manažment káblov&lt;br/&gt; Máte už dosť&lt;/strong&gt;káblovej spleti? Uvoľnite si miesto na stole vďaka dodávanému manažmentu káblov Z2-3D (Gen 3).&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;   &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE &lt;p&gt;Materiál: oceľ, hliníková zliatina ADC12&lt;br/&gt;Farba: matná čierna&lt;br/&gt;Naklonenie: +/- 90°&lt;br/&gt;Otočenie: 180°&lt;br/&gt;Otáčanie: 360° &lt;p&gt;Štandard VESA: 75 / 100&lt;br/&gt;Maximálna hmotnosť monitora: 8 kg (17.6 lbs) &lt;br/&gt;Veľkosť monitora Classis 16:9: do 34'&lt;br/&gt;Veľkosť ultrawide monitora: do 29'&lt;br/&gt;Rozširujúca sada: Z+1 Pro, Z+2 Pro, LH1 &lt;p&gt;Kompatibilita: Windows 10, 8,1, 7, Vista, XP,macOS, Linux&lt;br/&gt;Porty: 4x USB 3.2 Gen 1, s napájacím vstupom Micro USB&lt;br/&gt;Dĺžka kábla: 2 m.","false","0","","-1","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","2242.00","KS","2.00","16","2019-06-12T10:45:31.09","ARC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1467\/1467718_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1467\/1467718_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1467\/1467718_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1467\/1467718_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1467\/1467718_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1467\/1467718_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1467\/1467718_0g_3.jpg','7':'ht