,"76169990","766623461382","MANHATTAN Nástěnný držák LCD / TV, kloubový, 13” až 27”, 20 kg","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Univerzálny kĺbový nástenný držiak na plochý televízor&lt;/strong&gt;&lt;br/&gt;Dvojité rameno Podporí jeden 13' až 27' televízor alebo monitor do 20 kg.), Čierna&lt;/span&gt; &lt;ul&gt; &lt;li&gt;Bezpečne drží jeden plochý televízor&lt;/li&gt; &lt;li&gt;Optimalizujte si pohľad pomocou náklonu +5° až -12°, otočenia o ±90° a nastavenia úrovne ±3°&lt;/li&gt; &lt;li&gt;Rozšíri TV až na 35.4 cm (13.9 in.) zo steny&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;Nástenný držiak televízora takmer kdekoľvek &lt;p&gt;Prekonajte zvláštny pôdorys, nepríjemné oslnenie alebo nevhodné umiestnenie nábytku, ktoré môže obmedzovať zážitok z používania plochého televízora. Univerzálny nástenný držiak Manhattan na plochý televízor sa skladá takmer naplocho k stene a bezpečne sa vysúva na pevnom dvojramennom ráme, ktorý vám pomôže dosiahnuť vynikajúce pozície na sledovanie takmer z ktoréhokoľvek miesta v miestnosti. Tento kĺbový nástenný držiak je kompatibilný so štandardom VESA a je vyrobený z kvalitných materiálov, takže sa hodí pre rôzne veľkosti displejov a umožňuje bezpečnú a istú inštaláciu televízora nad podlahou. Perfektne sa hodí na montáž televízora v obývacej izbe, spálni alebo pracovni, ako aj na komerčné použitie v hoteloch, učebniach, konferenčných miestnostiach, na digitálnu reklamu a podobne. Univerzálny nástenný držiak na plochý televízor Manhattan prináša pôžitok z televízneho vysielania do popredia. &lt;p&gt;&lt;strong&gt;Funkcie&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Bezpečne drží jeden plochý televízor&lt;/li&gt; &lt;li&gt;Optimalizujte si pohľad pomocou náklonu +5° až -12°, otočenia o ±90° a nastavenia úrovne ±3°&lt;/li&gt; &lt;li&gt;Rozšíri TV až na 35.4 cm (13.9 in.) zo steny&lt;/li&gt; &lt;li&gt;Pevná oceľová konštrukcia&lt;/li&gt; &lt;li&gt;Jednoduchá inštalácia ideálna pre domáce, kancelárske a komerčné aplikácie&lt;/li&gt; &lt;li&gt;Odnímateľná doska VESA umožňuje rýchle a jednoduché upevnenie monitora alebo televízora&lt;/li&gt; &lt;li&gt;Spĺňa štandardy VESA - podporuje televízory s uhlopriečkou od 13' do 27' s hmotnosťou do 20 kg (44 libier).)&lt;/li&gt; &lt;li&gt;Doživotná záruka&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;strong&gt;ŠPECIFIKÁCIE&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Univerzálny kĺbový nástenný držiak na plochý televízor&lt;br/&gt;Vhodný pre televízory s rozmermi 75 x 75 alebo 100 x 100 kompatibilné so štandardom VESA&lt;br/&gt;Nosnosť: do 20 kg (44 libier).)&lt;br/&gt;Montážny profil: 50 až 354 mm&lt;/li&gt; &lt;li&gt;Obsah balenia&lt;br/&gt;Univerzálny kĺbový nástenný držiak na TV s plochou obrazovkou&lt;br/&gt;Montážny hardvér s návodom&lt;/li&gt; &lt;/ul&gt;.","false","22","0001022300050006","8455","-1","true","","-1","-1","true","36","Měsíc(ů)","","0001-01-01T00:00:00","279.00","KS","0.00","6","2019-06-19T10:27:42.197","MAN","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1468\/1468557_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1468\/1468557_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1468\/1468557_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1468\/1468557_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1468\/1468557_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1468\/1468557_0f_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'1.459','length':'21.5','width':'22.5','height':'5'},'1':{'typ':'PACK','count':'10','weight':'15.28','length':'55','width':'24','height':'24'}}","N","","false",""),("1468558","254767","MANHATTAN Stolní držák (univerzální) pro 4 Monitory LCD, 13” až 32”, 8kg","1057.40","1059.00","MAN","1.60","0.00","0.000000","0.000","36 Měsíc(ů)","MANHATTAN","1067.00","1214.00","21.00","461566","true","2,00","Na objednávku","Manhattan","76169990","766623461566","MANHATTAN Stolní držák (univerzální) pro 4 Monitory LCD, 13” až 32”, 8kg","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Univerzálny držiak na štyri monitory s dvojramennými výkyvnými ramenami&lt;/strong&gt;&lt;br/&gt;Udrží štyri 13' až 32' LCD monitory s hmotnosťou do 8 kg (17 libier).), Čierna&lt;/span&gt; &lt;ul&gt; &lt;li&gt;Spĺňa štandardy VESA - bezpečne drží štyri LCD monitory s uhlopriečkou od 13' do 32'&lt;/li&gt; &lt;li&gt;Umiestnenie monitorov nad pracovnú plochu s cieľom zväčšiť pracovný priestor, zlepšiť viditeľnosť a minimalizovať neporiadok&lt;/li&gt; &lt;li&gt;Dvojité výkyvné ramená so samostatným nastavením sklonu ±45°, otáčania ±180° a výšky&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;Správa pracovnej plochy. Maximalizujte produktivitu.&lt;br/&gt;Inštalácia LCD monitora nad pracovný stôl pomáha maximalizovať efektívnosť potenciálneho pracovného priestoru. Univerzálny držiak na štyri monitory Manhattan s dvojlinkovým výkyvným ramenom zlepšuje organizáciu na pracovnej ploche a uľahčuje prácu na počítači. &lt;p&gt;Tento držiak na štyri monitory je vyrobený z odolného tlakovo liateho kovu a má robustnú svorku, ktorá umožňuje rýchlu, jednoduchú a bezpečnú montáž bez potreby vŕtania dier do stolov alebo pracovných dosiek. Jeho plne nastaviteľné nastavenia sklonu, otáčania, natáčania do strán, výšky a napnutia vytvárajú dokonalú polohu na pohodlné zvýšenie produktivity. Takéto možnosti nastavenia môžu dokonca pomôcť znížiť únavu očí alebo namáhanie krku a chrbta. Okrem toho stĺpik držiaka umožňuje jednoduché otáčanie monitora, aby mohli ostatní sledovať prezentácie a multimediálne produkcie takmer z ľubovoľného smeru. &lt;p&gt;&lt;strong&gt;Funkcie&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Spĺňa štandardy VESA - bezpečne drží štyri LCD monitory s uhlopriečkou od 13' do 32'&lt;/li&gt; &lt;li&gt;Umiestnenie monitorov nad pracovnú plochu s cieľom zväčšiť pracovný priestor, zlepšiť viditeľnosť a minimalizovať neporiadok&lt;/li&gt; &lt;li&gt;Dvojité výkyvné ramená so samostatným nastavením sklonu ±45°, otáčania ±180° a výšky&lt;/li&gt; &lt;li&gt;Oceľový stĺp s ťažkým držiakom svorky&lt;/li&gt; &lt;li&gt;Odnímateľné dosky VESA, vďaka ktorým je upevnenie monitora rýchlejšie a jednoduchšie&lt;/li&gt; &lt;li&gt;Jednoduché nastavenie polohy monitora&lt;/li&gt; &lt;li&gt;Ideálne pre kancelárie, štúdiá, IT siete a bezpečnostné aplikácie&lt;/li&gt; &lt;li&gt;Jednoduchá inštalácia na akýkoľvek stôl alebo iný povrch - nie je potrebné vŕtanie&lt;/li&gt; &lt;li&gt;Doživotná záruka&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;strong&gt;ŠPECIFIKÁCIE&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Všeobecné informácie&lt;br/&gt;Vhodný pre monitory s rozmermi 75 x 75 mm / 100 x 100 mm kompatibilné so štandardom VESA&lt;br/&gt;Hmotnosť monitora: do 8 kg (17 libier).) každý&lt;br/&gt;Inštaluje sa na vodorovné povrchy do 10 - 85 mm (3.3 in.) hrubý&lt;/li&gt; &lt;li&gt;Rozmery&lt;br/&gt;Výška (tyč): 883 mm (34.8 in.)&lt;br/&gt;Dĺžka ramena (polomer): 399 mm (15.7 in.)&lt;br/&gt;Šírka ramena (vysunuté): 798 mm (31.4 in.)&lt;/li&gt; &lt;li&gt;Obsah balenia&lt;br/&gt;Univerzálny držiak na štyri monitory s dvojlinkovými výkyvnými ramenami&lt;br/&gt;Klipsy na vedenie káblov a krytky obloženia&lt;br/&gt;C-svorka so skrutkami s palcom&lt;br/&gt;Montážne a montážne skrutky na monitory&lt;br/&gt;Montážny hardvér s návodom a šesťhranným nástrojom&lt;/li&gt; &lt;/ul&gt;.","false","22","0001022300050006","8455","-1","true","","-1","-1","true","36","Měsíc(ů)","","0001-01-01T00:00:00","1067.00","KS","2.00","3","2019-06-19T10:30:20.573","MAN","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1468\/1468558_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1468\/1468558_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1468\/1468558_0c_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'7.935','length':'59.5','width':'19','height':'13'},'1':{'typ':'PACK','count':'2','weight':'16.3','length':'62','width':'21','height':'27'}}","N","","false",""),("1468586