le a má robustnú svorku, ktorá umožňuje rýchlu, jednoduchú a bezpečnú montáž bez potreby vŕtania dier do stolov alebo pracovných dosiek. Plne nastaviteľný sklon, natočenie, natočenie do strán, výška a nastavenie napätia umožňujú vytvoriť dokonalú polohu na pohodlné zvýšenie produktivity. Takéto možnosti nastavenia môžu dokonca pomôcť znížiť únavu očí alebo namáhanie krku a chrbta. Okrem toho stĺpik držiaka umožňuje jednoduché otáčanie monitora, aby mohli ostatní sledovať prezentácie a multimediálne produkcie takmer z ľubovoľného smeru. &lt;p&gt;&lt;strong&gt;Funkcie&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Spĺňa štandardy VESA - bezpečne drží jeden LCD monitor s uhlopriečkou od 13' do 32'&lt;/li&gt; &lt;li&gt;Umiestnenie monitora nad pracovnú plochu s cieľom zväčšiť pracovný priestor, zlepšiť viditeľnosť a minimalizovať neporiadok&lt;/li&gt; &lt;li&gt;Dvojité výkyvné rameno s náklonom ±45° a otáčaním o 360°&lt;/li&gt; &lt;li&gt;Oceľový stĺp s ťažkým držiakom svorky&lt;/li&gt; &lt;li&gt;Odnímateľné dosky VESA, vďaka ktorým je upevnenie monitora rýchlejšie a jednoduchšie&lt;/li&gt; &lt;li&gt;Jednoduché nastavenie polohy monitora&lt;/li&gt; &lt;li&gt;Ideálne pre kancelárie, štúdiá, IT siete a bezpečnostné aplikácie&lt;/li&gt; &lt;li&gt;Jednoduchá inštalácia na akýkoľvek stôl alebo iný povrch - nie je potrebné vŕtanie&lt;/li&gt; &lt;li&gt;Doživotná záruka&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;strong&gt;ŠPECIFIKÁCIE&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Všeobecné informácie&lt;br/&gt;Vhodný pre monitory s rozmermi 75 x 75 mm / 100 x 100 mm kompatibilné so štandardom VESA&lt;br/&gt;Hmotnosť monitora: do 8 kg (17 libier).) každý&lt;br/&gt;Inštaluje sa na vodorovné povrchy od 10 - 85 mm (3.3 in.) hrubý&lt;/li&gt; &lt;li&gt;Rozmery&lt;br/&gt;Výška (tyč): 443 mm (17.4 in.)&lt;br/&gt;Dĺžka ramena (polomer): 459 mm (18.1 in.)&lt;/li&gt; &lt;li&gt;Obsah balenia&lt;br/&gt;Univerzálny držiak monitora s dvojramenným výkyvným ramenom&lt;br/&gt;Klipsy na vedenie káblov a krytky obloženia&lt;b