h2&gt;&lt;p&gt;Používáte stůl s otvorem pro vedení kabelů? Použijte G-Clamp k připevnění ramene monitoru pro co nejčistší vzhled. Robustní G-Clamp (Grommet mount) používá kabeláž nebo povrchový otvor na stole s průchodkou pro pevné držení ramena monitoru na stole.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row tech-params'&gt;&lt;div class='desc'&gt;&lt;h2&gt;Technické specifikace&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Konstrukční typ ramena: ergonomický typ&lt;/li&gt;&lt;li&gt;Vnitřní struktura: kovová pružina&lt;/li&gt;&lt;li&gt;Materiál: Hliníková slitina&lt;/li&gt;&lt;li&gt;Vesa kompatibilita:  Vesa 75 x 75 mm, Vesa 100 x 100 mm&lt;/li&gt;&lt;li&gt;Nastavitelný rozsah výšky: 320 mm&lt;/li&gt;&lt;li&gt;Náklon  - 45 °/+ 60 °&lt;/li&gt;&lt;li&gt;Rotace: - 90 °/+ 90 °&lt;/li&gt;&lt;li&gt;Rozpětí: 265mm-325mm&lt;/li&gt;&lt;li&gt;Maximální velikost monitoru: 27' &lt;/li&gt;&lt;li&gt;Hmotnost bez balení: 2,4 kg&lt;/li&gt;&lt;li&gt;Hmotnost s balením: 3 kg&lt;/li&gt;&lt;/ul&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row tech-params'&gt;&lt;div class='desc'&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;","false","21","000100080004","218","-1","true","00020059","4158","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","631.00","KS","0.00","3","2019-06-24T14:39:14.867","AOC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1469\/1469058_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1469\/1469058_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1469\/1469058_0c_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'2.917','length':'41','width':'12','height':'28'},'1':{'typ':'PACK','count':'5','weight':'15.475','length':'61','width':'42','height':'31'}}","N","","false",""),("1469504","526051","CHIEF - tyč","350.00","350.00","DIS","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","DIGITAL SIGNAGE","350.00","350.00","21.00","CMS036","false","0,00","","Samsung","73239300","841872092829","CHIEF - tyč","Typ příslušenství:Držáky a stojany","1","Typ príslušenstva:Držiaky a stojany.","false","0","000103050005","11486","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","350.00","KS","0.00","1","2019-06-27T13:56:16.323","SAM","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1469\/1469504_0a_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'1.69','length':'100','width':'8','height':'8'}}","N","","false",""),("1470081","496675","ARCTIC nástěnný držák na monitor W1C","533.00","533.00","ARC","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","ARCTIC","533.00","617.00","21.00","AEMNT00058A","true","10,00","","Arctic Cooling","73262000","4895213701914","ARCTIC nástěnný držák na monitor W1C","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;W1C&lt;/strong&gt;&lt;/span&gt; &lt;p&gt;&lt;strong&gt;&lt;br/&gt;Nástenný držiak s výsuvným sklopným ramenom&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;&lt;strong&gt;Získajte späť miesto na pracovnom stole&lt;br/&gt;&lt;/strong&gt;Monitor pripevnite na stenu, aby ste ušetrili miesto na stole a udržali ho bez neporiadku pomocou ramena monitora W1C. Je tiež ideálnym riešením pre aplikácie s dotykovou obrazovkou. &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Optimalizovaná ergonómia&lt;br/&gt;&lt;/strong&gt;Ak trávite veľa času pred obrazovkou, rýchlo oceníte ergonomické výhody modelu W1C, najmä možnosť prispôsobiť si uhol pohľadu. Nájdenie optimálneho nastavenia obrazoviek zlepšuje držanie tela. Či už chcete nastaviť výšku, uhol alebo orientáciu obrazovky, W1C zlepšuje ergonomické možnosti vášho stola a kancelárskej stoličky a ponúka vám pohodlie a prispôsobivosť &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Vhodný aj pre ultraširokouhlé monitory&lt;br/&gt;&lt;/strong&gt;Nástenný držiak na monitor ARCTIC W1C bez problémov podporuje najnovšie ultraširokouhlé monitory (do 49 palcov). Kompatibilné sú aj klasické monitory s pomerom strán 16:9 (do 43 palcov). W1C unesie celkovú záťaž 18 kg/39.6 libier.&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;&lt;strong&gt;Optimálne zarovnanie&lt;br/&gt;&lt;/strong&gt;Montážna hlava ARCTIC W1C umožňuje jednoduchú inštaláciu a následné zmeny zarovnania. Nezáleží na tom, či chcete monitor mierne nakloniť alebo otočiť o 180 stupňov - jediné nástroje, ktoré potrebujete, sú vaše ruky.&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt; &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Manažment káblov&lt;br/&gt; Máte už dosť&lt;/strong&gt;káblovej spleti? S dodávaným manažmentom káblov W1C sú nepoddajné káble minulosťou &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Jednoduché a rýchle nastavenie&lt;br/&gt;&lt;/strong&gt;Stačí niekoľko jednoduchých krokov a dodané nástroje a W1C je v okamihu pripravený na použitie na vašej stene. &lt;p&gt;  &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE &lt;p&gt;&lt;strong&gt;Funkcie&lt;/strong&gt; &lt;p&gt;Naklonenie: +/- 15°&lt;br/&gt;Otočenie: 180°&lt;br/&gt;Otočenie: 360°&lt;br/&gt;Kompatibilita&lt;br/&gt;Kompatibilita: LCD/LED TV, stolové monitory a plazmové TV, ako sú LG, Viewsonic HP, AOC a Dell&lt;br/&gt;VESA: 75 / 100&lt;br/&gt;Pracovné zaťaženie: 18 kg / 39.6 lbs&lt;br/&gt;Veľkosť monitora Classis 16:9: do 43'&lt;br/&gt;Veľkosť ultrawide monitora: do 49'&lt;br/&gt;Vzdialenosť medzi stenou a zadnou stranou monitora: 39-469 mm.","false","0","","-1","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","533.00","KS","10.00","9","2019-07-03T10:05:24.697","ARC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1470\/1470081_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1470\/1470081_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1470\/1470081_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1470\/1470081_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1470\/1470081_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1470\/1470081_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1470\/1470081_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1470\/1470081_0h_