mpatibilní s naprostou většinou monitorových stojanů.&lt;/p&gt;  &lt;h2&gt;Seznam kompatibilních dokovacích stanic:&lt;/h2&gt;  &lt;p&gt;•&lt;strong&gt; i-tec USB 3.0 / USB-C / Thunderbolt 3 Dual 4K Display Docking Station + Power Delivery 65W&lt;/strong&gt;&lt;br /&gt;•&lt;strong&gt; i-tec USB 3.0 / USB-C / Thunderbolt 3 Dual 4K Display Docking Station&lt;/strong&gt;&lt;br /&gt;(seznam dalších dokovacích stanic se brzy rozšíří)&lt;/p&gt;  &lt;p&gt;Prosím, před nákupem a instalací držáku si ověřte, že váš monitor podporuje VESA standard pro montáž (100 x 100 mm, nebo 75 x 75 mm).&lt;/p&gt;  &lt;h2&gt;Specifikace&lt;/h2&gt;  &lt;p&gt;VESA držák na dokovací stanice je vyroben z pevného a odolného kovového materiálu&lt;br /&gt;Povrchová úprava odolná proti mechanickému poškození&lt;br /&gt;Podpora všech monitorů s VESA standardem:100 x 100 mm&lt;br /&gt;75 x 75 mm&lt;br /&gt;Jednoduchá instalace dokovací stanice k držáku za pomocí 2 šroubků&lt;br /&gt;Instalace dokovací stanice je možná jak ve vertikální, tak horizontální poloze&lt;br /&gt;Kabelový management je součástí balení&lt;br /&gt;Kompatibilní dokovací stanice&lt;br /&gt;• CADUA4KDOCKPDL/UK&lt;br /&gt;• CADUAL4KDOCK/UK&lt;br /&gt;Rozměry produktu: 120 x 190 x 5 mm&lt;br /&gt;Hmotnost produktu: 80 g&lt;br /&gt;Rozměry balení: 200 x 290 x 5 mm&lt;br /&gt;Hmotnost balení: 128 g&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Hardwarové požadavky&lt;/strong&gt;:&lt;br /&gt;Kompatibilní dokovací stanice i-tec&lt;br /&gt;Monitor či TV, kompatibilní s VESA standardem 100 x 100 mm nebo 75 x 75 mm&lt;/p&gt;  &lt;h2&gt;Obsah balení&lt;/h2&gt;  &lt;p&gt;produkt&lt;br /&gt;šroubky (6x)&lt;br /&gt;kabelový management (3x)&lt;br /&gt;manuál&lt;/p&gt;","false","0","000100880015","300","-1","true","00020033","4132","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","211.00","KS","0.00","5","2019-09-04T12:03:52.99","ITC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1484\/1484856_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACH