MNT00055A","false","0,00","","Arctic Cooling","73262000","4895213702423","ARCTIC prodlužovací rameno Z+1 Pro (Gen.3) pro držák monitoru Z1 Pro (Gen.3)","Typ příslušenství:Držáky a stojany","1","&lt;p&gt;&lt;strong&gt;Z+1 Pro (Gen3) - predlžovacie rameno pre ďalší monitor&lt;/strong&gt; &lt;p&gt;S monitorom Z+1 Pro (Gen 3) získate dokonalé vylepšenie svojej zostavy monitora. Predlžovacie rameno sa ľahko pripojí k existujúcemu držiaku a rozšíri zobrazovaciu plochu, či už ho práve používate na jednom, dvoch alebo troch monitoroch. &lt;p&gt;Individuálna konštrukcia, individuálne nastavenie: Konštrukcia montážnej hlavy s guľovým kĺbom ponúka zvýšenú flexibilitu pri otáčaní o 360°, otáčaní o 180° a nakláňaní o +/-15°. &lt;p&gt;Vďaka štandardom VESA 75x75 a 100x100 je Z+1 Pro (Gen 3) kompatibilný s väčšinou plochých displejov. Unesie bremená do 15 kg a podporuje klasické monitory s uhlopriečkou do 43 palcov a ultraširoké monitory s uhlopriečkou do 49 palcov. &lt;p&gt;Integrácia ďalšieho monitora do súčasného systému, a to obratom ruky: v niekoľkých krokoch sa nainštaluje dvojitý závitový stĺp Z+1 Pro (Gen 3) a ramená monitora sa prestavia. &lt;p&gt;Voľné káble sú usporiadané pomocou káblového manažmentu. &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE&lt;br/&gt;Materiál: Oceľ, hliníková zliatina ADC12&lt;br/&gt;Farba: Matná čierna&lt;br/&gt;Naklonenie: +/- 15°&lt;br/&gt;Otočenie: 180°&lt;br/&gt;Rotácia: 360° &lt;p&gt;KOMPATIBILITA&lt;br/&gt;Štandard VESA: 75x75/100x100&lt;br/&gt;Maximálna hmotnosť monitora: 15 kg (33 libier) na jeden držiak&lt;br/&gt;Veľkosť monitora Classis 16:9: do 34'&lt;br/&gt;Veľkosť ultrawide monitora: do 38'&lt;br/&gt;Kompatibilný s ARCTIC Monitor Arms: Z1 Pro (Gen2+3), Z2 Pro (Gen2+3), Z3 Pro (Gen 3), Z1-3D, Z1-3D (Gen 3), Z2-3D, Z2-3D (Gen 3)&lt;br/&gt;Viac tech. informácie: &lt;a href='https://www.arctic.ac/eu_en/z-1pro-gen3.html'&gt;https://www&lt;/a&gt;.arktída.ac/eu_en/z-1pro-gen3.html&lt;/a&gt;.","false","0","","-1","-1","true","","-1","-1","true","24","Měsí