","","0001-01-01T00:00:00","2355.00","KS","1.00","4","2021-03-24T09:28:19.337","FBM","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1557\/1557744_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1557\/1557744_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1557\/1557744_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1557\/1557744_0d_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'16.455','length':'78','width':'35','height':'17'}}","N","","false",""),("1580184","1512315","HP Z G3 Speaker bar (pro HP LCD Zxx G3 displaye)","1947.00","1947.00","HPC","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","HP PSG COMMERCIAL","1956.00","2329.00","21.00","32C42AA","false","0,00","","HP Inc.","85182100","","HP Z G3 Speaker bar (pro HP LCD Zxx G3 displaye)","Typ příslušenství:Reproduktory","1","&lt;div class='tpl-product-detail-desc'&gt;  &lt;div class='box-in'&gt;  &lt;div class='row'&gt;  &lt;figure class='box-img' style='text-align: justify;'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1580/1580184_6a.jpg' alt='Obr. Ideální na konference 1580184a' /&gt;&lt;/figure&gt;  &lt;div class='desc' style='text-align: justify;'&gt;  &lt;h2&gt;Ideální na konference&lt;/h2&gt;  &lt;p&gt;To, co říkáte a slyšíte při konferenčních hovorech, je stejně důležité jako to, co při nich vidíte. Pokud požadujete čistší, bohatší zvuk ve stylovém, flexibilním provedení, právě jste ho našli – konferenční reproduktorový panel Z G3 nabízí bezkonkurenční kvalitu.&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row' style='text-align: justify;'&gt;  &lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1580/1580184_6b.jpg' alt='Obr. Vynikající zvuk 1580184b' /&gt;&lt;/figure&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Vynikající zvuk&lt;/h2&gt;  &lt;p&gt;S dvěma širokofrekvenčními stereofonními reproduktory konečně uslyšíte každý zvuk v dechberoucí a podmanivé kvalitě. Díky dodatečným vstupům můžete navíc připojit další zdroj zvuku a přehrávat tak hudbu nebo média přímo na stole nebo připojit kabelová sluchátka a dopřát si soukromý zážitek z poslechu.&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row' style='text-align: justify;'&gt;  &lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1580/1580184_6c.jpg' alt='Obr. Dokonale doplňuje displej Z 1580184c' /&gt;&lt;/figure&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Dokonale doplňuje displej Z&lt;/h2&gt;  &lt;p&gt;Reproduktorový panel se krásně vejde na stůl díky montáži na podstavec displeje Z nebo DreamColor, kde navíc vypadá opravdu stylově. To není vše. Dodaný kabel USB-A umožňuje připojení k jakémukoli displeji a nabízí tak mimořádnou flexibilitu.&lt;/p&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row tech-params'&gt;  &lt;div class='desc'&gt;  &lt;h2 style='text-align: justify;'&gt;Technická specifikace&lt;/h2&gt;  &lt;ul&gt;  &lt;li style='text-align: justify;'&gt;Minimální rozměry (Š x H x V): 3,7 x 42 x 5,8 cm&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Hmotnost cca 0,47 kg&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Rozměry balení (Š x H x V): 7,3 x 45 x 9,75 cm&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Hmotnost balení cca 0,81 kg&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Záruka výrobce: 1 rok&lt;/li&gt;  &lt;li style='text-align: justify;'&gt;Obsah balení: Reproduktor; Kabel USB; Návod k obsluze HP; Dokumentace k záruce HP; Karta s produktovými informacemi HP&lt;/li&gt;  &lt;/ul&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;","false","0","000100460008","494","-1","true","00020039","4138","-1","true","12","Měsíc(ů)","9F","0001-01-01T00:00:00","1956.00","KS","0.00","3","2022-05-22T21:01:34.247","HPC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1580\/1580184_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1580\/1580184_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1580\/1580184_0c_3.jpg'}","{'0':{'AttributeCode':'913