 Š × V)	:435 mm x 67 mm x 67 mm mm&lt;/li&gt;&lt;li&gt;&lt;/li&gt;&lt;/ul&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1602/1602025_6a.jpg' alt='Obr. Waterproof-MOUSEPAD 1602025a' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Waterproof-MOUSEPAD&lt;/h2&gt;&lt;p&gt;Tato podložka pod myš poskytuje voděodolný povrch, který oceníte vždy, když se vám tak úplně nezadaří. Díky tomu budete schopni eliminovat následky drobných nehod stejně dobře jako své nepřátele.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1602/1602025_6b.jpg' alt='Obr. Anti-slip Rubber base - MOUSEPAD 1602025b' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Anti-slip Rubber base - MOUSEPAD&lt;/h2&gt;&lt;p&gt;Proč byste se měli ve hře vybavovat jen těmi nejlepšími předměty, ale u své sestavy dělat kompromisy? Tato podložka pod myš má protiskluzovou gumovou spodní stranu, která zajišťuje, že vám žádná výhra neproklouzne mezi prsty.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1602/1602025_6c.jpg' alt='Obr. Soft Mousepad - MOUSEPAD 1602025c' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Soft Mousepad - MOUSEPAD&lt;/h2&gt;&lt;p&gt;Jakmile si vyberete svou oblíbenou postavu nebo zbraň, zřejmě budete chtít vylepšit i její vzhled. A jelikož naší oblíbenou postavou jste vy, záleží nám na vzhledu vaší sestavy. Proto je tato podložka pod myš měkká a vyznačuje se obšitými okraji a látkovým potahem, jenž je příjemný pro vaši pokožku během nepříjemných bojů s vašimi nepřáteli.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1602/1602025_6d.jpg' alt='Obr. Size - MOUSEPAD 1602025d' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Size - MOUSEPAD&lt;/h2&gt;&lt;p&gt;Podložka pod myš je díky svému materiálu nejen velmi flexibilní, ale navíc umožňuje flexibilní použití i u vaší sestavy, protože se dodává ve 4 různých velikostech. Každá z nich přitom poskytuje stejně kvalitní herní zážitek. Můžete tak mít jednu podložku pod myš s ideální velikostí pro vaši hlavní herní sestavu a kromě toho také menší verzi s naprosto stejnými vlastnostmi, když chcete hrát kdekoli na cestách.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1602/1602025_6e.jpg' alt='Obr. Design - MOUSEPAD 1602025e' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Design - MOUSEPAD&lt;/h2&gt;&lt;p&gt;Podložka pod myš MM300L se dodává v klasické černé barvě s nádechem šedé, aby se perfektně hodila do vaší stávající sestavy a neodváděla pozornost od vašeho oblíbeného vybavení.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;","false","0","000100080004","218","-1","true","00020059","4158","-1","true","36","Měsíc(ů)","","0001-01-01T00:00:00","303.00","KS","0.00","4","2021-10-17T10:26:22.39","AOC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1602\/1602025_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1602\/1602025_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1602\/1602025_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1602\/1602025_0d_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11104'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.51','length':'48','width':'8','height':'8'}}","N","","false",""),("1602026","147824","AOC podložka pod myš MM300M","279.40","281.00","AOC","1.60","0.00","0.000000","0.000","36 Měsíc(ů)","AOC","279.00","279.00","21.00","MM300M","false","0,00","","AOC","85285210","4038986631037","AOC podložka pod myš MM300M","Typ příslušenství:Ostatní","1","&lt;div class='tpl-product-detail-desc'&gt;&lt;div class='box-in'&gt;&lt;div class='row tech-params'&gt;&lt;div class='desc'&gt;&lt;h2&gt;Technické specifikace&lt;/h2&gt;&lt;ul&