02\/1602028_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1602\/1602028_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1602\/1602028_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1602\/1602028_0d_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11104'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.93','length':'48','width':'10','height':'10'}}","N","","false",""),("1603334","1216521","APPLE Adaptér držáku VESA","4436.00","4436.00","APE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","APPLE","4436.00","4785.00","21.00","mwuf2cs/a","false","0,00","","Apple","94032080","190199474338","APPLE Adaptér držáku VESA","Typ příslušenství: Držáky a stojany","1","Pro profesionály, kteří místo tradičního stojanu používají VESA stojan, držák nebo rameno, představuje Adaptér držáku VESA ideální prostředek, jak Pro Display XDR hladce začlenit do pracovního prostoru. Funguje s jakýmkoli VESA držákem 100 × 100 mm na zeď, držákem nebo stojanem na stůl nebo kloubovým ramenem, které unese Pro Display XDR a jeho 7,48 kg.1 A dá se rychle a snadno umístit a zajistit přibaleným klíčem Apple.","false","0","00010162","5697","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","4436.00","KS","0.00","2","2021-10-21T09:58:33.54","APP","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603334_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603334_0b_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("1603335","1216522","APPLE Pro Stand","20482.00","20482.00","APE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","APPLE","20482.00","23959.00","21.00","mwug2cs/a","false","0,00","","Apple","94032080","190199474581","APPLE Pro Stand","Držák na monitor volně stojící • 32' až 32' • rotace 180° • systém pro uspořádání kabelů","1","&lt;h2 style='color:#e21b52;border-bottom:1px solid #eaecf5;margin-bottom:10px;font-size:1.42rem;font-weight:500'&gt;Pro stand-czs&lt;/h2&gt;&lt;div style='flex-flow: row wrap; display: flex;'&gt;&lt;div style='padding: 10px; flex: 1 1 40%;'&gt;Každý aspekt Pro Standu počítá s potřebami profesionálů. Výška, náklon, otočení, všechno se dá nastavit. Hladce tak Pro Display XDR začleníš do jakéhokoli pracovního prostředí.&lt;p style='margin:1.14rem 0;'&gt;&lt;span style='font-weight:500;'&gt;Nastavení výšky a náklonu&lt;/span&gt;&lt;br/&gt;Přesné naklánění a úprava výšky v rozmezí 120 mm umožňují nastavit Pro Display XDR na Pro Standu pro jakýkoli požadovaný úhel pohledu. Při změně výšky zůstává úhel displeje konstantní. Díky vysoce sofistikovanému mechanismu ramene působí displej, jakoby nic nevážil. Snadno ho nastavíš do požadované polohy. A v té zůstane.&lt;/p&gt;&lt;p style='margin:1.14rem 0;'&gt;&lt;span style='font-weight:500;'&gt;Otáčení&lt;/span&gt;&lt;br/&gt;Pro Stand umožňuje snadno překlopit displej mezi orientací na šířku a na výšku, kdykoli chceš. Orientaci displeje změníš jednoduše tak, že odemkneš posuvník a otočíš displej proti směru hodinových ručiček. Monitor se tak dá rychle přizpůsobit tomu, na jakém obsahu zrovna člověk pracuje.&lt;/p&gt;&lt;p style='margin:1.14rem 0;'&gt;&lt;span style='font-weight:500;'&gt;Modulárnost&lt;/span&gt;&lt;br/&gt;Magnetický konektor na Pro Standu se přichytí k magnetu na zadní straně Pro Displaye XDR. Magnety navedou spojení a vzápětí se automaticky aktivují západky, které displej bezpečně uzamknou na stojanu. Odpojení je záležitost jednoduchého odemknutí posuvníku.&lt;/p&gt;&lt;p style='margin:1.14rem 0;'&gt;&lt;span style='font-weight:500;'&gt;Rozsah pohybu stojanu&lt;/span&gt;&lt;br/&gt;Nastavování výšky: umožňuje nastavení výšky v celkovém rozsahu 120 mm (60 mm v obou směrech od středu) &lt;/br&gt;  Orientace: na šířku nebo na výšku &lt;/br&gt; Náklon: –5° až +25° &lt;/p&gt;&lt;p style='margin:1.14rem 0;'&gt;&lt;span style='font-weight:500;'&gt;Rozměry a hmotnost stojanu&lt;/span&gt;&lt;br/&gt;Výška (rameno v úhlu 0o, náklon 0o): 43,3 cm; výška (rameno v úhlu 45o, náklon 25o): 49,7 cm &lt;/br&gt; Šířka: 18,0 cm &lt;/br&gt; Hloubka: 23,6 cm  &lt;/br&gt; Hmotnost: 4,3 kg* &lt;/p&gt;&lt;/div&gt;&lt;div style='margin-left:auto;margin-right:auto;padding:10px;vertical-align:top;box-sizing:border-box;'&gt;&lt;img style='margin:0;padding:0;width:auto;height:auto;vertical-align:middle;display:inline-block;visibility:visible;max-width:300px;box-sizing:border-box;' src=https://edshopb2b.edsystem.cz/IMGCACHE/_1603/1603335_0c.jpg alt=''/&gt;&lt;/div&gt;&lt;/div&gt;","false","0","00010162","5697","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","20482.00","KS","0.00","3","2021-10-21T10:53:27.64","APP","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603335_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603335_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603335_0c_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'9.315','length':'62','width':'25','height':'36'}}","N","","false",""),("1603801","416626","NEC Stand ST-55E pro E558, E658","1019.00","1019.00","NEC","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","NEC","1019.00","1189.00","21.00","100015619","false","0,00","","NEC","73269098","5028695120518","NEC Stand ST-55E pro E558, E658","Typ příslušenství:Držáky a stojany","1","Feet for MultiSync E558, E658","false","0","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1019.00","KS","0.00","2","2021-10-25T09:39:09.19","NEC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603801_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603801_0b_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.5','length':'30','width':'17.5','height':'5.5'}}","N","","false",""),("1603802","416627","NEC Stand ST-65E3 pro E657Q","1747.00","1747.00","NEC","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","NEC","1747.00","1941.00","21.00","100015197","false","0,00","Novinka","NEC","73269098","","NEC Stand ST-65E3 pro E657Q","Typ příslušenství:Držáky a stojany","1","Feet for MultiSync E657Q","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1747.00","KS","0.00","2","2021-10-25T09:40:00.433","NEC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603802_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603802_0b_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("1603803","416628","NEC Stand  ST-32E proE326, E327","0.00","0.00","NEC","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","NEC","898.00","995.00","21.00","100013911","false","0,00","Novinka","NEC","73269098","","NEC Stand  ST-32E proE326, E327","Typ příslušenství:Držáky a stojany","1","Feet for MultiSync E326, E327","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","898.00","KS","0.00","2","2021-10-25T09:40:56.133","NEC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603803_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603803_0b_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("1605416","523203","ARCTIC držák na monitor X1, ocel, matná černá","590.00","590.00","ARC","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","ARCTIC","590.00","683.00","21.00","AEMNT00061A","false","0,00","","Arctic Cooling","73262000","4895213703581","ARCTIC držák na monitor X1, ocel, matná černá","Typ příslušenství:Držáky a stojany","1","&lt;h2&gt;X1&lt;/h2&gt; &lt;p style='text-align: justify;'&gt;Rameno na montáž monitora na stôl &lt;ul&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;PLNÝ POHYB PRE VÄČŠÍ KOMFORT&lt;/strong&gt; - Vďaka otočnému ramenu zostáva monitor flexibilne pohyblivý aj po montáži. Pomocou jednoduchej rukoväte sa dá nastaviť aj jeho výška. Vďaka tomu je hračkou monitor vytiahnuť, posunúť alebo úplne zmeniť nastavenie výšky, hĺbky a sklonu.&lt;/li&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;ERGONOMICKÉ NASTAVENIE OBRAZOVKY&lt;/strong&gt; - X1 premení najjednoduchšie obrazovky na ergonomické zázraky a tí, ktorí trávia veľa času pred obrazovkou, túto výhodu rýchlo ocenia: optimálne nastavenie obrazovky automaticky podporuje ergonomické držanie tela. Nezáleží na tom, či pracujete v sede alebo v stoji, rameno monitora umožňuje optimálne prispôsobenie prostrediu.&lt;/li&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;Menej viditeľné káble&lt;/strong&gt; - S X1 sú zamotané káble okolo monitorov minulosťou. Káble možno jednoducho viesť paralelne s ramenom a zavesiť ich do káblových kanálov. Týmto spôsobom zmiznú z viditeľnej oblasti a podporia celkový upravený vzhľad.&lt;/li&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;JEDNODUCHÁ A RÝCHLA MONTÁŽ&lt;/strong&gt; - Vďaka stolovej svorke možno rameno monitora voľne a ľahko umiestniť na okraj stola. Rameno je kompletne zmontované a jednoducho sa nasadí na tyč. Montáž alebo neskoršie premiestnenie je preto hračka a dá sa vykonať rýchlo.&lt;/li&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;UNIVERZÁLNE KOMPATIBILNÉ&lt;/strong&gt; - Rameno monitora podporuje ultraširoké monitory s uhlopriečkou obrazovky ? 49', ako aj monitory 16:9 s uhlopriečkou ? 43'. Monitor musí mať držiak VESA 75 alebo VESA 100 a nesmie presiahnuť celkovú hmotnosť 15 kg.&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;  &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE &lt;table dir='LTR' border='1' width='800' cellspacing='0' cellpadding='2'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px; text-align: center;' colspan='2' width='74%' height='19'&gt;&lt;strong&gt;funkcie&lt;/strong&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;materiál&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;oceľ, zinková zliatina&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;farba&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;matt Black&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;naklonenie&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;+/-15°&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;otočný&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;180°rokov&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;rotácia&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;360°rokov&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;záruka&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;6 rokov&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px; text-align: center;' colspan='2' width='74%' height='19'&gt;&lt;strong&gt;kompatibilita&lt;/strong&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;vESA&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;75x75/100x100&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;max. monitorovať hmotnosť&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;33 libier / 15 kg&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;veľkosť monitora 16:9&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;43'&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;veľkosť ultraširokého monitora&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;49'&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;hrúbka stolovej dosky*&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;20 až 55 mm&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt; &lt;strong&gt;Rozšírenia&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;-&lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt; &lt;/table&gt; &lt;p&gt; *V prípade stolov s konštrukciou Honeycomb alebo sendvičovou konštrukciou s dutými vreckami odporúčame pridať vystužovaciu dosku, aby sa zabránilo poškodeniu dosky stola svorkami. &lt;p&gt; .","false","0","","-1","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","590.00","KS","0.00","9","2021-11-16T09:35:26.097","ARC","51","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1605\/1605416_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1605\/1605416_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1605\/1605416_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1605\/1605416_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1605\/1605416_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1605\/1605416_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1605\/1605416_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1605\/1605416_0h_3.jpg','8':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1605\/1605416_0i_3.jpg'}","{'0':{'AttributeCode':'913','ValueCode':'11101'}}","{'0':{'typ':'JEDN','count':'1','weight':'2.869','length':'45','width':'11','height':'20'},'1':{'typ':'PACK','count':'4','weight':'12.1','length':'46','width':'21','height':'45'}}","N","","false",""),("1605417","523204","ARCTIC držák na monitor X1-3D, ocel, matná černá","1065.00","1065.00","ARC","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","ARCTIC","1065.00","1171.00","21.00","AEMNT00062A","true","3,00","","Arctic Cooling","73262000","4895213703598","ARCTIC držák na monitor X1-3D, ocel, matná černá","Typ příslušenství:Držáky a stojany","1","&lt;h2&gt;X1-3D&lt;/h2&gt; &lt;p&gt;Plynové rameno monitora na stôl &lt;ul&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;ÚPLNÝ POHYB PRE VÄČŠIE POHODLIE&lt;/strong&gt; - Vďaka schválenej technológii plynového zdvihu možno monitor úplne voľne pohybovať všetkými smermi, a to aj po inštalácii. Vďaka tomu je hračkou monitor vytiahnuť, posunúť alebo úplne zmeniť nastavenie výšky, hĺbky a sklonu.&lt;/li&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;ERGONOMICKÉ NASTAVENIE OBRAZOVKY&lt;/strong&gt; - X1-3D mení najjednoduchšie obrazovky na ergonomické zázraky a tí, ktorí trávia veľa času pred obrazovkou, túto výhodu rýchlo ocenia: optimálne nastavenie obrazovky automaticky podporuje ergonomickú polohu pri sedení. Nezáleží na tom, či pracujete v sede alebo v stoji, rameno monitora vám umožní optimálne ho prispôsobiť vášmu prostrediu.&lt;/li&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;ROZŠÍRENÝ PRACOVNÝ PRIESTOR&lt;/strong&gt; - Či už stôl používate ako pracovisko, bojovú stanicu alebo ako kombináciu oboch. Vďaka tomu, že 'neutrálna zóna dosahu' zostáva voľná, poskytuje X1-3D viac priestoru okolo monitorov a umožňuje vám nové spôsoby nastavenia a optimalizácie pracovného priestoru.&lt;/li&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;Menej viditeľné káble&lt;/strong&gt; - S X1-3D sú zamotané káble okolo monitorov minulosťou. Káble sa dajú jednoducho prenášať a upevniť v ramene. Takto zmiznú z viditeľnej oblasti a podporia celkový upravený vzhľad.&lt;/li&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;JEDNODUCHÁ A RÝCHLA MONTÁŽ&lt;/strong&gt; - Vďaka stolovej svorke možno rameno monitora voľne a ľahko umiestniť na okraj stola. Rameno je kompletne zmontované a jednoducho sa nasadí na tyč. Montáž alebo neskoršie premiestnenie je preto hračka a dá sa vykonať rýchlo.&lt;/li&gt; &lt;li style='text-align: justify;'&gt;&lt;strong&gt;UNIVERZÁLNE KOMPATIBILNÉ&lt;/strong&gt; - Rameno monitora podporuje ultraširoké monitory s uhlopriečkou obrazovky ? 43', ako aj monitory 16:9 s uhlopriečkou ? 40'. Monitor musí mať držiak VESA 75 alebo VESA 100 a nesmie presiahnuť celkovú hmotnosť 10 kg.&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;  &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE &lt;table dir='LTR' border='1' width='800' cellspacing='0' cellpadding='2'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px; text-align: center;' colspan='2' width='74%' height='19'&gt;&lt;strong&gt;funkcie&lt;/strong&gt;&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;materiál&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;Oceľ, hliníková zliatina ADC 12, zinková zliatina&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;farba&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;Matt Black&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;naklonenie&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;+/-15°&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;otočný&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;180°rokov&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;rotácia&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;360°rokov&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;záruka&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;6 rokov&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px; text-align: center;' colspan='2' width='74%' height='19'&gt;&lt;strong&gt;kompatibilita&lt;/strong&gt;&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td sty